INSERT INTO `agenda` VALUES (65,'OMG Conference 29-30 Juli 2016 Surabaya','omg-conference-2930-juli-2016-surabaya','<p>\r\nHalo <a href=\"https://www.facebook.com/hashtag/surabaya?source=feed_text&amp;story_id=1214340041939618\" class=\"_58cn\"><span class=\"_58cl\">‪#&lrm;</span><span class=\"_58cm\">SURABAYA‬</span></a> !\r\n</p>\r\n<p>\r\nBulan Juli ini OMG Conference &ldquo;UNASHAMED&rdquo; akan diselenggarakan di kota \r\nAnda pada tanggal 29-30 Juli 2016. Bertempat di GKI Pregolan Bunder, \r\nconference ini akan memperlengkapi Anda ; Pastor, Christian community \r\nand youth leader untuk kembali kepada panggilan akan pemberitaan Injil.\r\n</p>\r\n<p>\r\n&ldquo;UNASHAMED&rdquo; akan menginspirasi kita untuk melihat kesempatan \r\npemberitaan Injil dan memuridkan melalui media dan platform kreatif \r\nsebagai ladang misi dan cara yang relevan untuk d<span class=\"text_exposed_show\">igunakan di era ini.</span>\r\n</p>\r\n<div class=\"text_exposed_show\">\r\n<p>\r\n *<br />\r\n Jumat &ndash; Sabtu, 29 &amp; 30 Juli 2015<br />\r\n Hari 1 pukul 17.00 &ndash; 21.00 WIB<br />\r\n Hari 2 08.00 &ndash; 17.00 WIB\r\n</p>\r\n<p>\r\n *<br />\r\nSpeakers : Ps. Jonathan Pattiasina (GARAM Ministry), yesHEis Team, Ps. \r\nJeffrey Aghogho (YWAM Surabaya), Ps. Erlangga Dharma (Indonesia Moeda)\r\n</p>\r\n<p>\r\n *<br />\r\n GKI Pregolan Bunder<br />\r\n Jl. Pregolan Bunder No. 36, Tegalsari<br />\r\n Surabaya 60226<br />\r\n Jawa Timur &ndash; Indonesia\r\n</p>\r\n<p>\r\n *<br />\r\n Event Registration\r\n</p>\r\n<p>\r\n Registrasi ONLINE : <a rel=\"nofollow\" href=\"http://www.omg-conference.com/\" target=\"_blank\">http://www.omg-conference.com/</a>\r\n</p>\r\n<p>\r\n Biaya pendaftaran<br />\r\n Rp 150.000 / 1pax<br />\r\n Rp 350.000 / 3pax<br />\r\n Pendaftaran ditutup pada tanggal 27 Juli 2016\r\n</p>\r\n<p>\r\n Rekening Transfer<br />\r\n BCA a/n Olivia 088 057262 8\r\n</p>\r\n<p>\r\n *<br />\r\n Contact Person &amp; Pendaftaran :<br />\r\n Yanny Surjana (yannysurjana@yesHEis.com, 0811 2211 775)<br />\r\n Tyan Yestenia (tityanyestenia@yesHEis.com, 0813 9330 0399)\r\n</p>\r\n<p>\r\n <a rel=\"nofollow\" href=\"https://www.youtube.com/watch?v=I23Mpm7BLMg\" target=\"_blank\">https://www.youtube.com/watch?v=I23Mpm7BLMg</a>\r\n</p>\r\n</div>\r\n','GKI Pregolan Bunder Jl. Pregolan Bunder No. 36, Tegalsari Surabaya 60226 Jawa Timur – Indonesia','','86185313406896_1211460315560924_942288413088462428_n.jpg','2016-07-29','2016-07-30','2016-06-17','Hari 1 pukul 17.00 – 21.00 WIB Hari 2 08.00 – ',552,'admin'),(66,'Pemulihan Segala Sesuatu','pemulihan-segala-sesuatu','Seminar Father and Son Bersama Hamba-hamba Tuhan yaitu Tony Mulia, Sammiton Pangelah, Andreas Nawawi, Ronny Daud Simeon, Daniel Pandji, Timothy Parengkuan. Yang diadakan pada hari Sabtu 4, 11, 18, 25 Juni 2015 jam 13:00 - 16:00 WIB. Kelapa Gading - House of Worship. Jl. Kelapa Puan Raya FU1 NO. 13-14 Kelapa Gading Permai, Jakarta 14240\r\n','Kelapa Gading - House of Worship. Jl. Kelapa Puan Raya FU1 NO. 13-14 Kelapa Gading Permai, Jakarta 1','','70216613406823_10209818551568425_5224674607128687580_n.jpg','2016-06-04','2016-06-25','2016-06-21','13:00 - 16:00 WIB',248,'admin'),(67,'Seminar ANTIHEDONIS','seminar-antihedonis','<p>\r\nSebuah Seminar yang bertujuan untuk mengembalikan gaya hidup dunia kepada gaya hidup Kerajaan Allah dan membahas isu kontemporer gaya hidup hedonis.\r\n</p>\r\n<p>\r\nTempat : APL Tower Lt. 27 (Central Park Praise Centre)\r\n</p>\r\n<p>\r\nWaktu :&nbsp; 17 September 2016, 09.00 - 13.00 WIB\r\n</p>\r\n<p>\r\nHTM : Rp. 30.000,-/orang (include Snack)\r\n</p>\r\n<p>\r\nPembicara : Ade Surya Tarigan(Tema : be the LIGHT not Glamour), Ferry Felani(Tema : CHRIST, Crystal, and Crisis), Dieter Nicolas(Tema : ANTI-hedonis\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nUntuk Registrasi dan Konfirmasi : Bank BCA no. rek. 3721213003 an. Andreas Tan / Hubungi 0812.8210.811 (Andreas Tan) \r\n</p>\r\n','APL Tower Lt. 27 (Central Park Praise Centre)','','911162razer-gallery-4.jpg','2016-09-17','2016-09-17','2016-06-21','09.00 - 13.00 WIB',102,'admin'),(68,'Konser Doa PGPI One Heart','konser-doa-pgpi-one-heart','<h1><span>Ingat Konser Doa PGPI se Jawa Barat, <br />\r\nTema: One Heart For Generation, City &amp; Nation<br />\r\nHari/tgl: Selasa, 19 Juli 2016<br />\r\nTempat: Rhema Buliding, Kalimalang-Bekasi<br />\r\nPukul: 10.00-16.00</span></h1>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n','Rhema Buliding, Kalimalang-Bekasi','','173921pgpi1.jpg','2016-07-19','2016-07-19','2016-06-23','10.00-16.00',110,'admin'),(69,'Seminar untuk Guru, Orang tua, Pembina anak dan remaja','seminar-untuk-guru-orang-tua-pembina-anak-dan-remaja','<p>\r\nHadirilah Seminar yang akan memperbincangkan mengenai &quot;Generasi GOOGLE \r\ndan Tantangan Teknologi Kekinian&quot; oleh Praktisi IT dan Teologi dari \r\nSingapura, Ang Wie Hay, M.Sc., M.Div. . pada Sabtu, 13 Agustus 2016 di \r\nYayasan Mercusuar, Jl. Soepomo no.210, Tebet - Jakarta (50m dari Univ \r\nSahid).\r\n</p>\r\n<p>\r\n&nbsp;<img src=\"data:image/jpeg;base64,\" alt=\"\" />\r\n</p>\r\n<p>\r\nInformasi Pendaftaran Hubungi :\r\n</p>\r\n<p>\r\nWA : 08571669 3414\r\n</p>\r\n<p>\r\nHP : 0852 1199 0877\r\n</p>\r\n<p>\r\nEmail :haiministry@yahoo.com\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\nAnda dapat berkontribusi untuk snack, lunch, goodie bag &amp; sertifikat\r\n</p>\r\n<p>\r\n23 Mei - 30 Juni Rp.100.00\r\n</p>\r\n<p>\r\n1 - 30 Juli Rp.125.000&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>BCA : 63 1010 9493</strong> a.n Yeni Krismawati\r\n</p>\r\n<p>\r\n1 - 7 Agustus Rp.150.000 \r\n</p>\r\n','Yayasan Mercusuar','','','2016-08-13','2016-08-13','2016-06-28','Hari 1 pukul 17.00 – 21.00 WIB Hari 2 08.00 – ',79,'admin');
