INSERT INTO `album` VALUES (28,'Murah Meriah di Pasar Asemka','murah-meriah-di-pasar-asemka','Pasar Asemka, Jakarta, merupakan pasar grosir yang banyak menyediakan berbagai aksesoris seperti kalung, cincin, Souvenir pernakahan, dan lainnya. Di Pasara Asemka anda akan dimanjakan dengan beragam barang yang dibandrol dengan harga murah meriah dan biasanya dijual grosiran. \r\n','18asemka.jpg','Y',201,'2016-08-18','23:14:05','Sabtu','admin'),(29,'Karpet Raksasa dari Bunga','karpet-raksasa-dari-bunga','Belgia sedang memperingati peristiwa tahunan &quot;La Fete De La Fleur&quot; atau pesta bunga di bulan Agustus. Ahli bunga merancang karpet raksasa dari bunga di depan Grand Place di Brussel. Karpet ini dibuat menggunakan 700 ribu bunga.\r\n','92bungaraksasa2.jpg','Y',76,'2016-08-19','03:02:27','Minggu','admin'),(30,'Konser Kantata Barock 2015','konser-kantata-barock-2015','Para macan tua yang digawangi Iwan Fals, Setiawan Djody dan Sawung Jabo di Stadion Gelora Bung Karno, Jakarta,\r\nJumat (30/12) malam. Kantata kembali membawakan lagu-lagu legendarisnya\r\nsetelah 21 tahun vakum dari dunia musik.\r\n<div style=\"overflow: hidden; color: #000000; background-color: #ffffff; text-align: left; text-decoration: none; border: medium none\">\r\n<br />\r\n</div>\r\n','4520kantata_barock.jpg','Y',88,'2016-08-20','09:12:06','Senin','admin'),(31,'Festival Seni Terbesar di Dunia','festival-seni-terbesar-di-dunia','','13festival_seni.jpg','Y',67,'2016-08-20','09:40:01','Senin','admin'),(32,'Kegiatan Sosial','kegiatan-sosial','Makan sehat, pelatihan karakter &amp; perilaku yg diadakan tiap Sabtu \r\npertama awal bulan untuk anak-2 di kebon sayur, Kamal, Cengkareng.\r\n','44kegiatan1.jpg','Y',28,'2016-05-09','11:42:24','Senin','admin'),(33,'Pelatihan Karakter','pelatihan-karakter','Div pendidikan ISRA Jakarta bersinergi memberikan pelatihan karakter dan\r\nperilaku keanak-anak kebun pisang kolong tol, Teluk Gong.\r\n','24pelatihan1.jpg','Y',36,'2016-05-09','13:23:19','Senin','admin'),(34,'bersinergi dengan YWAM from Dutch pelatihan karakter ','bersinergi-dengan-ywam-from-dutch-pelatihan-karakter-','Div pendidikan Isra Jakarta bersinergi dng YWAM from Dutch memberikan pelatihan karakter dan perilaku ke anak-2 kurang mampu.\r\n','18plthn.jpg','Y',50,'2016-05-09','13:36:39','Senin','admin'),(35,' Anak Indonesia punya mimpi','-anak-indonesia-punya-mimpi','','87rusun.jpg','Y',59,'2016-05-09','14:03:43','Senin','admin'),(36,'Memberikan kata sambutan','memberikan-kata-sambutan','','30rusun1.jpg','N',1,'2016-05-09','14:05:21','Senin','admin'),(37,'Peresmian DreamProgram','peresmian-dreamprogram','','57rusun2.jpg','N',1,'2016-05-09','14:06:18','Senin','admin'),(38,'foto bersama','foto-bersama','','77rusun3.jpg','N',1,'2016-05-09','14:07:01','Senin','admin'),(39,'pelatihan \"REVOLUSI Rajin\"','pelatihan-revolusi-rajin','','28staf.jpg','Y',45,'2016-05-09','14:16:51','Senin','admin'),(40,'revolusi rajin','revolusi-rajin','','3revolusi.jpg','Y',53,'2016-05-09','15:20:08','Senin','admin'),(41,' Youth Leaders Gathering sinergi','-youth-leaders-gathering-sinergi','Isra Jakarta hadir dalam acara Youth Leaders Gathering sinergi dng Father &amp; Son.\r\n','721936271_628326787333780_8390659835636246920_n.jpg','Y',62,'2016-05-09','15:39:17','Senin','admin'),(42,' pembinaan karakter dan prilaku di retreat Waria','-pembinaan-karakter-dan-prilaku-di-retreat-waria','','84warrior.jpg','Y',43,'2016-05-09','16:15:13','Senin','admin'),(53,'event Buka Puasa Bersama PEDULI KASIH dan ISRA','event-buka-puasa-bersama-peduli-kasih-dan-isra','','2913432144_200422093686448_6769382109492281255_n.jpg','Y',28,'2016-05-19','15:10:51','Kamis','admin'),(54,'ISRA Jakarta bersinergi dng Yayasan Pondok Kasih Jakarta,','isra-jakarta-bersinergi-dng-yayasan-pondok-kasih-jakarta','ISRA Jakarta bersinergi dng <a id=\"js_2k\" href=\"https://www.facebook.com/yayasan.pondok.kasih\" class=\"profileLink\">Yayasan Pondok Kasih</a> Jakarta, bersama Indosiar, O Channel mengadakan seminar keluarga dan buka puasa bersama warga rusunawa Cipinang Besar.\r\n','1913423798_200421840353140_809607839952892426_n.jpg','Y',33,'2016-06-16','09:20:16','Kamis','admin'),(55,'Truth, Lies & in Between seminar.','truth-lies--in-between-seminar','','37Truth, Lies & in Between seminar.jpg','Y',25,'2016-06-16','11:42:35','Kamis','admin'),(56,'Finally, baju layak pakai telah tersalurkan bagi yang membutuhkan.','finally-baju-layak-pakai-telah-tersalurkan-bagi-yang-membutuhkan','<p>\r\nFinally, baju layak pakai telah tersalurkan bagi yang membutuhkan.\r\n</p>\r\n<p>\r\n Lokasi:<br />\r\n 1. Kolong Jalan Tol Km. 11, Jelambar - Kalijodo, Jakarta<br />\r\n 2. TK Kumnamu - Tangerang\r\n</p>\r\n<div class=\"text_exposed_show\">\r\n<p>\r\n Program ini terlaksana atas sinergi dari Flyover dengan <a href=\"https://www.facebook.com/profile.php?id=100011414729329\" class=\"profileLink\">Yayasan Kebun Anggur</a> dan <a href=\"https://www.facebook.com/profile.php?id=100011559759580\" class=\"profileLink\">Isra SahabatJakarta</a>\r\n</p>\r\n<p>\r\n Tetaplah jadi berkat bagi sesama.<br />\r\n Tq para donatur, GBU\r\n</p>\r\n</div>\r\n','1113654139_1250289741678681_2548911224866014457_n.jpg','Y',22,'2016-07-18','11:33:57','Senin','admin'),(57,'Umat Kristen RI di Melbourne Gelar Doa Buat Bangsa','umat-kristen-ri-di-melbourne-gelar-doa-buat-bangsa','<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px; line-height: 22.4px\">Komunitas Kristen asal Indonesia di Melbourne hari Sabtu dan Minggu (6-7/8/2016) mengadakan acara Doa Untuk Bangsa di Uniting Church di kawasan Brunswick</span>\r\n','15kr4.jpg','Y',21,'2016-08-25','14:51:47','Kamis','admin');
