INSERT INTO `berita` VALUES (970,56,'admin','Polisi Sebut Pelaku Tewasnya 3 Mahasiswa UII Lebih Dari 1 Orang','Polisi Sebut Pelaku Tewasnya 3 Mahasiswa UII Lebih Dari 1 Orang','','polisi-sebut-pelaku-tewasnya-3-mahasiswa-uii-lebih-dari-1-orang','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Jakarta</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\"> - Tiga orang mahasiswa UII Yogyakarta tewas karena menjadi korban kekerasan saat mengikuti Pendidikan dan Latihan Dasar (Diklatsar) The Great Camping (TGC) di Gunung Lawu, Jawa Tengah. Polisi menduga ada lebih dari satu pelaku dalam kasus tersebut.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Lebih dari satu (pelakunya). Mulai mengerucut, tinggal coba membuktikan,\" kata Kapolres Karanganyar AKBP Ade Safri Simanjuntak kepada detikcom, Rabu (25/1/2017) malam.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Ade menjelaskan, Diklatsar The Grand Camping (TGC) diikuti oleh 37 peserta termasuk tiga korban meninggal, yaitu Syaits Asyam (19), Muhammad Fadli (19), dan Ilham Nurfadmi Listia Adi (20). Sementara jumlah panitia ada 44 orang.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Mereka dibuat lima regu, satu regu itu ada tujuh sampai delapan orang. Setiap regu diampu tiga atau empat orang seniornya. Kebetulan tiga orang yang meninggal ini berada dalam satu regu,\" ungkap Ade.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Namun saat ditanya apakah ketiga atau keempat orang tersebut adalah tersangkanya, Ade hanya tertawa. Dia masih belum mau membeberkan lebih lanjut spekulasi tersebut.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Itu nantilah,\" ujarnya sambil tertawa.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Tiga mahasiswa UII yang tewas tersebut adalah Syaits Asyam (19), Muhammad Fadli (19), dan Ilham Nurfadmi Listia Adi (20). Mereka tewas setelah mengikuti Diklatsar The Grand Camping (TGC).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Tiga mahasiswa UII itu awalnya mengikuti kegiatan TGC di lereng selatan Gunung Lawu di Desa Gondosuli, Kecamatan Tawangmangu, Kabupaten Karanganyar, Jawa Tengah, pada 13-20 Januari 2017. Total peserta diksar ada 37 mahasiswa dari berbagai fakultas di UII, yang terdiri dari 34 peserta laki-laki dan 3 perempuan. </span><br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(bis/jor)</strong>\r\n','','Kamis','2017-01-26','09:40:57','76a.jpg',1869,'politik,metropolitan'),(971,39,'admin','Presiden Meksiko Didesak Batalkan Pertemuan dengan Trump','Presiden Meksiko Didesak Batalkan Pertemuan dengan Trump','','presiden-meksiko-didesak-batalkan-pertemuan-dengan-trump','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Mexico City</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Perintah Presiden Amerika Serikat (AS) Donald Trump untuk segera merencanakan dan membangun tembak perbatasan dengan Meksiko menuai kecaman. Oposisi Meksiko mendorong Presiden Enrique Pena Nieto untuk membatalkan rencana pertemuan dengan Trump, pekan depan.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Pengumuman&nbsp;</span><em style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">@realDonaldTrump</em><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;soal tembok (perbatasan) sebelum kunjungan&nbsp;</span><em style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">@EPN</em><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;(Presiden Nieto) adalah penghinaan untuk Meksiko,&quot; ucap Margarita Zavala, yang merupakan calon presiden Meksiko dari Partai Aksi Nasional (PAN), via Twitter, seperti dilansir&nbsp;</span><em style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">AFP</em><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">, Kamis (26/1/2017).&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Kunjungan itu harus dipertimbangkan kembali,&quot; imbuh Zavala.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Rencananya, Presiden Nieto akan berkunjung ke Washington DC pada 31 Januari. Sejumlah pejabat tinggi Meksiko, seperti Menteri Luar Negeri dan Menteri Perekonomian Meksiko telah berada di Washington DC untuk mempersiapkan kunjungan Presiden Nieto.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pada hari yang sama saat delegasi Meksiko tiba di AS, Trump menandatangani perintah perencanaan dan pembangunan tembok perbatasan Meksiko. Trump juga menegaskan Meksiko akan mengganti biaya pembangunan tembok perbatasan sepanjang 3.200 kilometer itu.</span><br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Baca juga:</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;</span><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\"><a style=\"text-decoration: none; border: none; font-weight: bold; color: #19378f\" href=\"https://news.detik.com/read/2017/01/26/053125/3405741/934/trump-teken-keputusan-pembangunan-tembok-as-meksiko\" target=\"_blank\">Trump Teken Keputusan Pembangunan Tembok AS-Meksiko</a></span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pada Selasa (24/1) waktu setempat, Menteri Perekonomian Meksiko Ildefonso Guajardo menyatakan Meksiko akan menarik diri dari perundingan dengan pemerintahan Trump, jika AS bersikeras membuat pemerintah Meksiko membayar pembangunan tembak perbatasan itu.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Belum ada komentar dari kantor Presiden Nieto terkait hal ini. Terakhir kali Presiden Nieto bertemu Trump semasa kampanye pilpres, dia dikritik habis-habisan di dalam negeri. Terlebih karena Presiden Nieto menjamu Trump yang pernah menyebut imigran Meksiko sebagai pemerkosa dan penjahat narkoba.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Kini, Presiden Nieto berada di bawah tekanan karena akan bertemu Trump lagi. Senator Miguel Barbosa dari Partai Revolusi Demokratik (PRD), yang juga oposisi, menyebut Presiden Nieto tak seharusnya berunding saat di bawah tekanan atau membiarkan pemerintahan Trump menentukan hasil perundingan.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Sedangkan Senator Armando Rios Piter yang juga dari PRD menyebut pengumuman pembangunan tembok perbatasan itu sebagai &#39;aksi keji&#39; yang seharusnya membuat Presiden Nieto membatalkan kunjungan ke AS.</span><br />\r\n<br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(nvc/fdn)</strong>\r\n','','Kamis','2017-01-26','09:42:23','42s.jpg',1417,'internasional'),(972,58,'admin','Jalur Trenggalek-Ponorogo Kembali Tertutup Longsor','Jalur Trenggalek-Ponorogo Kembali Tertutup Longsor','','jalur-trenggalekponorogo-kembali-tertutup-longsor','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Trenggalek</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Ruas jalan nasional Trenggalek-Ponorogo tertutup total akibat tanah longsor yang terjadi di KM 16 dan 17 Desa Nglinggis, Kecamatan Tugu, Trenggalek.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Kejadian longsor sekitar pukul 15.00 WIB, ini ada beberapa titik yang longsor, jalur sementara ditutup total,&quot; kata Kapolsek Tugu, Iptu Bambang Purwanto, Rabu (25/1/2017).&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Menurutnya, material longsor yang runtuh terdiri dari tanah dan bebatuan. Bahkan di salah satu titik terdapat batu berukuran besar yang jatuh tepat di tengah jalan.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Volume longsor lumayan banyak, sedangkan kondisi cuaca masih hujan seperti ini sangat berbahaya dan rawan longsor susulan,&quot; ujarnya.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Akibat kejadian tersebut saat ini terjadi antrean panjang kendaraan dari arah Ponorogo maupun Trenggalek. Untuk menghindari penumpukan kendaraan, polisi memasang rambu peringatan di beberapa titik.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Tadi saya juga sudah menghubungi Polsek Sawoo, Ponorogo untuk menutup jalur yang menuju Trenggalek, kemudian untuk Trenggalek kami arahkan ke Pacitan,&quot; imbuh Bambang.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Sementara Camat Tugu, Budianto mengatakan, rencananya proses pembersihan material longsor baru akan dilakukan setelah kondisi benar-benar aman dan tidak berbahaya bagi tim evakuasi.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Kemungkinan baru bisa dibersihkan besok pagi, kalau malam ini masih rawan. Kalau alat berat sudah siap,&quot; katanya.&nbsp;</span><br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(fat/fat)</strong>\r\n','','Kamis','2017-01-26','09:48:05','47as.jpg',2140,'daerah'),(973,56,'admin','Polisi Periksa Panitia Diksar Maut Mapala UII Senin Pekan Depan','Polisi Periksa Panitia Diksar Maut Mapala UII Senin Pekan Depan','','polisi-periksa-panitia-diksar-maut-mapala-uii-senin-pekan-depan','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Jakarta</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Polsek Karanganyar, Jawa Tengah, berencana memanggil beberapa panitia Pendidikan dan Latihan Dasar (Diklatsar) The Great Camping (TGC), yang menyebabkan kematian tiga mahasiswa UII. Mereka rencananya akan dipanggil pada Senin (30/1) mendatang.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Kapolres Karanganyar AKBP Ade Safri Simanjuntak mengatakan sebenarnya kepolisian sudah melayangkan panggilan kepada 14 anggota panitia diklat tersebut pada Rabu (25/1) kemarin. Namun pemanggilan tersebut urung dilakukan karena koordinasi antara kepolisian dan pihak rektorat UII mengalami jalan buntu. Alasannya, para panitia hanya mau memenuhi panggilan polisi bila ada surat pemanggilan resmi dan ditemani oleh pengacara.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Hari ini (Rabu kemarin) sebenarnya sudah ada agenda penyidik untuk melakukan pemeriksaan pada 14 panitia untuk diperiksa sebagai saksi. Namun hasil koordinasi dengan (pihak) rektorat untuk menghadirkan mereka menemui kendala, karena dari panitia tidak mau diperiksa kalau tidak ada pemanggilan resmi dari kepolisian. Mereka juga mau didampingi oleh pengacara,&quot; kata Ade kepada&nbsp;</span><strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">detikcom</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">, Rabu (25/1).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Kamis (26/1) akan kita layangkan panggilan resmi untuk kami periksa pada hari Senin,&quot; lanjutnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Ade menjelaskan Diklatsar The Grand Camping (TGC) diikuti oleh 37 peserta, termasuk tiga korban meninggal, yaitu Syaits Asyam (19), Muhammad Fadli (19), dan Ilham Nurfadmi Listia Adi (20). Sedangkan jumlah panitia ada 44 orang. Sejauh ini, sudah ada 18 peserta yang dimintai keterangan oleh polisi.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Mereka dibuat lima regu, satu regu itu ada tujuh sampai delapan orang. Setiap regu diampu tiga atau empat orang seniornya. Kebetulan tiga orang yang meninggal ini berada dalam satu regu,&quot; ungkap Ade.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Dari beberapa saksi yang kita periksa, ada hukuman yang meliputi&nbsp;</span><em style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">push-up, sit-up</em><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">, pukulan, tendangan, dan pecutan,&quot; lanjutnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Tiga mahasiswa itu adalah Muhammad Fadli (19) dari jurusan Teknik Elektro angkatan 2015, Syaits Asyam (19) dari Teknik Industri, dan Ilham Nurpadmy Listia Adi dari Fakultas Hukum angkatan 2015.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Tim internal UII dalam rilisnya pada Selasa (24/1) memaparkan adanya temuan awal dan perkembangan investigasi kegiatan The Great Camping (TGC), yang dilakukan pada 13-20 Januari 2017.&nbsp;</span><br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(bis/jor)</strong>\r\n','','Kamis','2017-01-26','10:05:52','91ee.jpg',1886,'hukum,metropolitan'),(974,37,'admin',' Pencarian Mahasiswi Cantik Terseret Arus Sungai Fokus di Empat Titik',' Pencarian Mahasiswi Cantik Terseret Arus Sungai Fokus di Empat Titik','','-pencarian-mahasiswi-cantik-terseret-arus-sungai-fokus-di-empat-titik','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pasuruan</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Nasib Felansia Indriani (21), mahasiswi cantik asal Desa Kaliselo, Kecamatan Donomulyo, Kabupaten Malang, yang hilang terbawa arus Sungai Kedunglarangan, Pasuruan, belum diketahui. Pencarian oleh Tim SAR gabungan hari ini dilanjutkan.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Pencarian hari pertama kemarin nihil. Hari ini kita mulai lagi,&quot; kata Camat Bangil, Rahmad Sarifuddin, di posko pencarian, Kelurahan Kalirejo, Kecamatan Bangil, Kamis (26/1/2017).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pencarian hari kedua mahasiswi kesehatan tersebut masih dilakukan di empat titik, sama seperti hari pertama. Empat titik penyisiran antara lain, titik pertama dimulai dari Dam Bekacak, yang merupakan titik awal korban hanyut sampai Jembatan Kedunglarangan.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Titik kedua dimulai dari sebelah utara utara Jembatan Kedunglarangan sampai Jembatan Jembatan Kalianyar. Titik ketiga dari Jembatan Kedunglarangan sampai muara laut dan titik keempat dari Dam Tambakan sampai simpang 3 Sungai Kalianyar.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Kajian dari tim SAR, di empat tiik ini dinilai paling memungkinkan lokasi korban,&quot; kata Rahmat.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pencarian melibatkan puluhan anggota Basarnas, BPBD, Satpol PP dan sejumlah relawan. Sejumlah perahu karet dikerahkan untuk penyisiran.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Felansia Indriani (21) terseret arus di Sungai Kedunglarangan, Selasa (24/1) petang, saat menyeberangi jembatan kecil di sekitar Dam Bekacak yang menghubungkan Kecamatan Rembang dan Kecamatan Bangil.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Ia menyeberangi Sungai Kedunglarangan dibonceng motor Vixion oleh teman prianya, Wahyudi. Saat tiba di tengah jembatan, korban terseret arus besar yang datang tiba-tiba. Sebelum kejadian di hulu Sungai Kedunglarangan terjadi hujan deras.&nbsp;</span><br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(fat/fat)</strong>\r\n','','Kamis','2017-01-26','10:11:03','34sda.jpg',2271,'daerah'),(975,55,'admin','Panglima TNI Yakin Personelnya Tak Terlibat Penyelundupan Senjata','Panglima TNI Yakin Personelnya Tak Terlibat Penyelundupan Senjata','','panglima-tni-yakin-personelnya-tak-terlibat-penyelundupan-senjata','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Jakarta</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\"> - Anggota pasukan perdamaian PBB dari Indonesia tertahan untuk kembali ke Tanah Air karena terbelit kasus dugaan penyelundupan senjata dari Sudan. Diduga ada berbagai jenis senjata api dan amunisi yang diselundupkan oleh pasukan perdamaian dari Indonesia tersebut.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Terkait hal itu, Panglima TNI Jenderal TNI Gatot Nurmantyo mengatakan pihak Kementerian Luar Negeri dan Kepolisian Republik Indonesia (Polri) sudah terbang ke Sudan untuk mengetahui duduk perkara kasus itu secara lebih jelas.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Kemlu dan kepolisian sudah berangkat ke sana, mungkin sudah sampai. Dan akan melihat apa yang sebenarnya terjadi,\" kata Gatot di Markas Divisi Infanteri 1/Kostrad, Jalan Raya Jakarta-Bogor, Cilodong, Kota Depok, Jawa Barat, Rabu (25/1/2017) malam.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Gatot meyakini tidak ada satu pun personel TNI yang terlibat dalam kasus itu. Pasalnya, tidak ada lambang TNI maupun Polri di barang yang diduga diselundupkan tersebut.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Karena itu kan tidak ada lambang polisi atau TNI. Mau ambil juga buat apa? Saya yakin TNI tidak ada satu pun yang terlibat,\" ucapnya tegas.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Sebelumnya, Kepala Pusat penerangan TNI Mayjen TNI Wuryanto menjelaskan hal serupa. Dia membantah pemberitaan media setempat yang mengatakan ada anggota yang ditangkap berasal dari UNAMID (United Nations-African Union Missions in Darfur).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Personel TNI kontingen UNAMID sebanyak 850 orang akan kembali ke Indonesia pada Maret nanti. Ia menjelaskan, di Sudan terdapat dua misi perdamaian Indonesia di bawah bendera PBB. Selain UNAMID, juga ada Satgas Formed Police Unit (FPU) yang berasal dari kepolisian Indonesia.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Diberitakan, senjata dan amunisi yang diduga diselundupkan adalah 29 pucuk senapan Kalashnikov, 4 senjata api, 6 senjata tipe GM3, 61 pistol berbagai jenis, dan sejumlah besar amunisi.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pihak Polri membantah jika dikatakan senjata yang diduga diselundupkan itu merupakan milik pasukan Garuda Bhayangkara II Kontingen Formed Police Unit (FPU) VIII. Memang ada insiden penundaan keberangkatan gara-gara ada yang menuduh anggota FPU menyelundupkan senjata tertentu.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Saat ini, Polri bersama kepolisian Sudan tengah melakukan </span><em style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">joint investigation</em><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\"> untuk mendalami kasus ini. Kapolri Jenderal Tito Karnavian mempertanyakan tuduhan penyelundupan tersebut. Sebab, menurutnya, amunisi di Indonesia sudah cukup.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Tito menjelaskan koper milik FPU VIII berjumlah 141 buah dan sudah diperiksa sejak 19 Januari lalu. Lalu, pada saat di bandara, terdapat koper lain yang sudah ada sebelum pasukan FPU VIII dari Indonesia datang.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Kontainernya dihitung 141, tetap sama. Lalu masuk </span><em style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">X-ray</em><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">. Koper itu masuk ada identitasnya. Sepuluh meter dari koper itu ada tumpukan jenis berbeda. Itu bukan milik kita,\" kata Tito di PTIK, Jalan Tirtayasa, Kebayoran Baru, Jakarta Selatan, Rabu (25/1). </span><br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(jbr/rjo)</strong>\r\n','','Kamis','2017-01-26','10:16:04','522510b909-9355-43c3-ab89-496c3bb14421_169.jpg',899,'hukum'),(976,55,'admin',' Johan Budi: Pertemuan dengan Presiden Jokowi Inisiatif Antasari',' Johan Budi: Pertemuan dengan Presiden Jokowi Inisiatif Antasari','','-johan-budi-pertemuan-dengan-presiden-jokowi-inisiatif-antasari','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Jakarta</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Setelah menerima grasi, mantan Ketua KPK Antasari Azhar akan menemui Presiden Jokowi di Istana Kepresidenan. Pertemuan itu sudah diajukan Antasari sejak dulu.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pertemuan bakal berlangsung di Istana Merdeka, Jl Medan Merdeka Utara, Jakarta, Kamis (26/1/2017), yang direncanakan pukul 16.00 WIB nanti.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Staf Khusus Presiden Bidang Komunikasi Johan Budi menjelaskan pertemuan ini digelar atas inisiatif Antasari. &quot;Pertemuan Antasari dengan Presiden adalah atas permohonan yang diajukan Pak Antasari,&quot; kata Johan lewat pesan singkat kepada&nbsp;</span><strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">detikcom</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">, Kamis (26/1).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Bahkan permohonan untuk bertemu dengan Jokowi itu sudah jauh hari dilayangkan. Namun baru hari ini Jokowi bisa menyanggupinya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Permohonan untuk bertemu Presiden sudah diajukan Pak Antasari sejak lama melalui Menteri Sekretaris Negara. Dan baru sore hari ini Presiden bisa menerima Antasari,&quot; tutur Johan.&nbsp;</span><br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(dnu/jor)</strong>\r\n','','Kamis','2017-01-26','11:01:39','83da.jpg',892,'hukum,politik'),(977,37,'admin','Tanggul Sungai Gunting Jebol, Ratusan Rumah dan Jalan Banjir','Tanggul Sungai Gunting Jebol, Ratusan Rumah dan Jalan Banjir','','tanggul-sungai-gunting-jebol-ratusan-rumah-dan-jalan-banjir','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Jombang</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\"> - Tanggul Sungai Gunting jebol sepanjang 50 meter di Dusun Johoclumprit, Desa/Kecamatan Sumobito, Kabupaten Jombang. Akibatnya, air sungai yang meluap merendam jalur Mojokerto-Jombang, puluhan hektar lahan pertanian, serta ratusan rumah di tiga kecamatan.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Subandi (45) warga Desa Sumobito mengatakan, jebolnya tanggul terjadi, Rabu (25/1) menjelang tengah malam. Menurut dia, debit air yang meningkat kiriman dari wilayah hulu di Wonosalam membuat tanggul yang sudah kritis ambrol.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Ambrol di dua titik sepanjang 50 meter sehingga air sungai meluap ke sawah dan perkampungan,\" kata Subandi di lokasi, Kamis (26/1/2017).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Ambrolnya tanggul Sungai Gunting berdampak cukup luas. Sekitar 85 hektare tanaman tebu dan padi di Kecamatan Mojoagung, Kesamben dan Sumobito. Tak hanya itu, jalan desa tepat di sisi timur Sungai Gunting terputus. Bahkan jalur alternatif Mojokerto-Jombang via Curah Malang tergenang air.</span><br />\r\n<table border=\"0\" class=\"pic_artikel_sisip_table\" align=\"center\" style=\"text-align: center; margin-bottom: 10px; color: #929292; font-size: 12px; line-height: 14.4px; width: 540px; table-layout: fixed; font-family: helvetica, arial\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div class=\"pic_artikel_sisip\" align=\"center\" style=\"margin-bottom: 25px; font-size: 12px; line-height: 14.4px; width: 534px\">\r\n\t\t\t<div class=\"pic\" style=\"position: relative; display: inline-block; width: 540px; max-width: 100%; background: #f9f9f9; padding-bottom: 10px\">\r\n\t\t\t<img style=\"max-width: 100%; overflow: hidden; margin-bottom: 5px; display: block; margin-left: auto; margin-right: auto; height: auto !important\" src=\"https://images.detik.com/community/media/visual/2017/01/26/636bb992-ca9c-44a5-99a2-63c8faa08b3d_43.jpg?w=480\" alt=\"Tanggul Sungai Gunting Jebol\" />Tanggul Sungai Gunting Jebol Foto: Enggran Eko Budianto\r\n\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Kami berharap pemerintah segera memperbaiki tanggul sungai. Karena hujan masih tinggi, kalau dibiarkan banjir akan meluas,\" ujar Subandi.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Meluapnya Sungai Gunting juga mengakibatkan banjir di empat desa di tiga kecamatan. Diantaranya Desa Sumobito dan Curah Malang-Kecamatan Sumobito, Desa Karobelah-Kecamatan Mojoagung, dan Desa Pojokrejo-Kecamatan Kesamben.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Seperti di Desa Curah Malang, ketiggian air di perkampungan mencapai 30 cm sampai 1 meter. Menurut salah seorang warga, Nurhayati (50), air mulai masuk pemukiman penduduk sekitar pukul 03.00 Wib.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Kami minta pemerintah serius mengatasi banjir ini,\" tandasnya. </span><br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(fat/fat)</strong>\r\n','','Kamis','2017-01-26','12:06:26','31wed.jpg',897,'sekitar kita,daerah'),(979,46,'admin','Netty Heryawan dan Dedi Mulyadi Jenguk Jamal Bocah yang Kehilangan Lengannya','Netty Heryawan dan Dedi Mulyadi Jenguk Jamal Bocah yang Kehilangan Lengannya','','netty-heryawan-dan-dedi-mulyadi-jenguk-jamal-bocah-yang-kehilangan-lengannya','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Bandung</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Kondisi Jamaludin Muhammad (6), bocah asal Garut yang kehilangan kedua lengannya mengetuk sejumlah tokoh di Jabar. Istri Gubernur Jabar sekaligus Ketua Pusat Pelayanan Terpadu Pemberdayaan Perempuan dan Anak (P2TP2A) Netty Prasetyani dan juga Bupati Purwakarta Dedi Mulyadi menjenguk Jamal di RSHS.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Keduanya tidak datang bersama-sama. Dedi datang lebih pagi. Ia sempat berbincang dengan ayah Jamal, Heriyadi (28) dan juga tim dokter. Heriyadi bercerita sebelum dibawa ke RSHS, Jamal sempat dibawa ke puskesmas Cisewu Garut. Lalu dibawa ke RS Al Ihsan Bandung sebelum akhirnya dirujuk ke RSHS.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Sebelum pulang, Dedi sempat memberikan bantuan agar Jamal bisa mendapatkan lengan palsu.</span><br />\r\n<br />\r\n<table border=\"0\" class=\"pic_artikel_sisip_table\" align=\"center\" style=\"text-align: center; margin-bottom: 10px; color: #929292; font-size: 12px; line-height: 14.4px; width: 540px; table-layout: fixed; font-family: helvetica, arial\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div class=\"pic_artikel_sisip\" align=\"center\" style=\"margin-bottom: 25px; font-size: 12px; line-height: 14.4px; width: 534px\">\r\n\t\t\t<div class=\"pic\" style=\"position: relative; display: inline-block; width: 540px; max-width: 100%; background: #f9f9f9; padding-bottom: 10px\">\r\n\t\t\t<img style=\"max-width: 100%; overflow: hidden; margin-bottom: 5px; display: block; margin-left: auto; margin-right: auto; height: auto !important\" src=\"https://images.detik.com/community/media/visual/2017/01/26/f7cb20e7-eda0-468e-913a-0b114ee70549.jpeg?a=1\" alt=\"Netty Heryawan dan Dedi Mulyadi Jenguk Jamal Bocah yang Kehilangan Lengannya\" />Foto: Istimewa\r\n\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Sementara itu, Netty dayang bersama dengan tim dari Dinas Kesehatan, Biro Bansos dan Baznas. Netty menyatakan akan membentuk forum komunikasi agar penanganan Jamal lebih komprehensif.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Sehingga nanti bisa menindaklanjuti berbagai aspek, setelah mendapatkan penanganan medis, masa depannya juga harus kita perhatikan,&quot; ujar Netty di RS Hasan Sadikin, Jalan Pasteur Kamis (26/1/2017).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Menurut istri Gubernur Jabar Ahmad Heryawan tersebut, kebutuhan keluarga selama menjaga pasien akan ditanggung oleh Baznas.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Ketua Baznas Jabar menyatakan sudah siap menanggung kebutuhan keluarga selama menjaga pasien di Rumah Sakit. Karena seringkali keluarga pasien membutuhkan bantuan selama menjaga pasien,&quot; ucapnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pihaknya juga akan membantu pendampingan psikolog bagi Jamal. &quot;Kita melihat apa yang bisa kita bantu dari P2TP2A. Psikolog juga jika memang diperlukan untuk pendampingan,&quot; ucapnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Dari sisi pendidikan, Netty juga mengaku sudah berkoordinasi dengan Dinas Pendidikan Provinsi Jawa Barat guna mempersiapkan pendidikan Jamal ke depannya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Saat recovery, dinas pendidikan harus turun tangan. Bisa jadi, bukan pendidikan biasa yang diterapkan untuk anak ini, tapi mendatangkan tutor. Kami juga menjamin aksebilitas pendidikan dibuat sedemikian rupa. Kasus ini memang harus dipikirkan,&quot; tandasnya.</span><br />\r\n<br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(avi/ern)</strong>\r\n','','Kamis','2017-01-26','14:26:45','81804b5df-2cbe-4643-a43d-edd547171d74.jpg',464,'daerah,kesehatan'),(980,54,'admin','SIKAP HIDUP ORANG KRISTEN','SIKAP HIDUP ORANG KRISTEN','','sikap-hidup-orang-kristen','N','N','N','<div>\r\n<div class=\"MsoNormal\" style=\"color: #666666; font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif; font-size: 13px\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"color: #666666; font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif; font-size: 13px\">\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><span style=\"box-sizing: border-box; text-align: center; border-radius: 0px !important\"><strong style=\"box-sizing: border-box; border-radius: 0px !important\"><u style=\"box-sizing: border-box; border-radius: 0px !important\">Matius 7:1-12</u>.</strong>&nbsp;Menarik untuk diperhatikan bahwa khotbah di bukit ini merupakan rangkaian khotbah yang sangat terstruktur. Di pasal 5 dan 6, Yesus berbicara mengenai diri pribadi atau jati diri orang Kristen, bagaimana orang Kristen harus memiliki watak seperti Kristus. Yesus menetapkan standar karakter yang tinggi bagi pengikut-pengikut-Nya. Orang Kristen harus memiliki karakter yang lebih unggul dari dunia, sehingga terlihat perbedaan antara pengikut Kristus dan yang bukan. Kemudian di pasal 7, Yesus berbicara tentang hubungan orang Kristen dengan orang lain dan Bapa Surgawi. Jika kita memiliki karakter Kristus maka kita harus mempraktekkannya.</span><span style=\"box-sizing: border-box; text-align: center; border-radius: 0px !important\">&nbsp;</span><span style=\"box-sizing: border-box; text-align: center; border-radius: 0px !important\">Dalam teks pembacaan ini ada 3 sikap yang perlu dilakukan seorang pengikut Kristus.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 13.5pt; text-indent: -13.5pt; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><strong style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">1.</span></strong>&nbsp;<strong style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">Sikap terhadap Saudara Seiman (ayat 1-5,12)</span></strong></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 13.5pt; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><strong style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">a. Jangan menghakimi (1-5)</span></strong><strong style=\"box-sizing: border-box; border-radius: 0px !important\"></strong></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\">Yesus secara khusus mengangkat hal ini karena sikap ini sering kali kita lakukan dan sering kali pula kita tidak sadar bahwa kita sudah melakukannya. Seringkali kita lebih melihat kesalahan atau kekurangan saudara kita yang cuma sedikit namun tidak menyadari kesalahan/kekurangan kita yang banyak.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">Pelarangan Yesus untuk menghakimi tidak berarti menutup mata terhadap kesalahan dan kekurangan saudara-saudara kita. Yesus tidak sedang bermaksud menghilangkan sikap kritis kita untuk menyatakan kesalahan orang lain. Pelarangan ini jangan membuat kita menjadi takut untuk menyatakan kesalahan atau memberikan kritikan kepada orang lain jika memang itu perlu untuk dilakukan.</span><span style=\"box-sizing: border-box; border-radius: 0px !important\">&nbsp;</span><span style=\"box-sizing: border-box; border-radius: 0px !important\">Sebaliknya, arti menghakimi adalah:</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 22.5pt; text-indent: -9pt; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">&middot;</span>&nbsp;<span style=\"box-sizing: border-box; border-radius: 0px !important\">Berusaha mencari-cari kesalahan orang lain untuk menjatuhkannya.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 22.5pt; text-indent: -9pt; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\">&middot;&nbsp;<span style=\"box-sizing: border-box; border-radius: 0px !important\">Memberikan cap atau label atau julukan pada seseorang padahal orang itu tidaklah seperti itu. Mungkin memang</span><span style=\"box-sizing: border-box; border-radius: 0px !important\">&nbsp;</span><span style=\"box-sizing: border-box; border-radius: 0px !important\">orang itu pernah&nbsp;</span>melakukan suatu kesalahan, namun tidak menjadi kebiasaannya.</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 22.5pt; text-indent: -9pt; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">&middot;</span>&nbsp;<span style=\"box-sizing: border-box; border-radius: 0px !important\">Menyalahkan atau menuduh seseorang sebelum tahu persoalan yang sebenarnya, lalu memberi hukuman terhadap orang tersebut.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 22.5pt; text-indent: -9pt; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">&middot;</span>&nbsp;<span style=\"box-sizing: border-box; border-radius: 0px !important\">Menganggap diri selalu benar sedangkan orang lain selalu salah.</span><span style=\"box-sizing: border-box; font-size: 12pt; border-radius: 0px !important\">&nbsp;</span><span style=\"box-sizing: border-box; border-radius: 0px !important\">Sikap-sikap seperti itulah yang dikatakan oleh Yesus sebagai sikap menghakimi.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 9pt; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 9pt; border-radius: 0px !important\">\r\n<strong style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\">b. Perlakukan orang lain seperti kita mau diperlakukan (ayat 12)</span></span></strong>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\">Pada ayat 1-5, Yesus melarang kita untuk menghakimi dengan mencari-cari kesalahan, menuduh, memberi cap pada orang lain karena kita tidak lebih baik dari orang lain. Kita masih manusia yang masih bisa bersalah karena itu Yesus menasihatkan supaya kita menghargai dan menjaga perasaan sesama kita. Kita tentu mau diperlakukan dengan baik, maka kita harus lebih dahulu bersikap baik dan memperlakukan orang lain dengan baik. Jika kita mau dihargai, kita harus menghargai orang lain. Jika kita mau orang tersenyum kepada kita, tersenyumlah lebih dulu. Jika kita tidak mau dibenci, janganlah membenci orang lain.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\">Yesus mengatakan bahwa ayat ini merupakan inti dari hukum Taurat. Jika kita sudah melakukan dan mempraktekkannya maka kita sudah melakukan hukum Taurat. Jadi marilah kita memperlakukan saudara-saudara kira sebagaimana kita mau diperlakukan.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<strong style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\">2. Sikap terhadap &rdquo;anjing&rdquo; dan &rdquo;babi&rdquo;</span></span></strong>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">Sepintas mendengar ucapan ini kita bisa kaget karena terkesan sangat kasar, padahal sebelumnya Yesus menganjurkan kita untuk bersikap baik terhadap orang lain. Tentu ada alasan Yesus mengatakan hal demikian. Salah satu alasannya adalah karena Yesus adalah pribadi yang jujur dan tidak suka kompromi. Jika ya, dikatakan &rsquo;ya&rsquo;, jika tidak dikatakan &rsquo;tidak&rsquo;. Yesus bersikap baik terhadap orang lain namun dalam kasus-kasus tertentu yang bersifat prinsipil dalam hubungannya dengan kebenaran, Yesus bersikap tegas tanpa kompromi. Di beberapa bagian Injil terdapat perkataan Yesus yang keras. Yesus dengan berani mengatakan Herodes Antipas sebagai &rsquo;serigala&rsquo; karena kejahatannya (Lukas 13:32), Yesus menyebut ahli Taurat dan orang&nbsp;</span>Farisi &rsquo;kuburan yang dilabur putih&rsquo; dan &rsquo;keturunan ular beludak&rsquo; (Mat. 23:27,33) karena kemunafikan mereka.</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">Kita memang tidak boleh menghakimi, menuduh, mencari-cari kesalahan orang lain tetapi jika ada terjadi kesalahan janganlah disembunyikan atau kompromi.</span><span style=\"box-sizing: border-box; border-radius: 0px !important\">&nbsp;</span><span style=\"box-sizing: border-box; border-radius: 0px !important\">Lalu siapakah yang disebut Yesus sebagai&nbsp;</span><strong style=\"box-sizing: border-box; border-radius: 0px !important\">&rsquo;anjing&rsquo;&nbsp;</strong>dan&nbsp;<strong style=\"box-sizing: border-box; border-radius: 0px !important\">&rsquo;babi&rsquo;</strong>? Kata &rsquo;anjing&rsquo; ini tidak sama dalam Matius 15:26 (perempuan Kanaan). Anjing dalam Mat 15:26 adalah sejenis anjing peliharaan yang disayangi tuannya, tetapi dalam teks ini, anjing yang dimaksudkan adalah anjing liar yang jorok yang berkeliaran di jalan dan hidup dengan makan sampah. Babi adalah binatang haram bagi orang Yahudi dan juga binatang yang senang mengorek-ngorek tanah dengan mulutnya. Kedua binatang ini menggambarkan orang yang menolak dan melecehkan Firman Tuhan, lalu menghina dan mengejek Tuhan. Sedangkan mutiara menggambarkan berita Injil. Kedua kata ini tidaklah ditujukan kepada seorang pencuri atau perampok atau penjahat lainnya, namun ditujukan kepada seorang yang dengan sadar memandang remeh Injil atau Firman Tuhan. Bisa jadi dia adalah seorang yang terhormat dalam masyarakat, orang yang kaya, namun tidak mau menerima Firman, malah menolak dan menghina Allah terang-terangan. Kepada orang seperti inilah Yesus melarang kita untuk terus memberitakan Injil.</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\">Jadi sikap kita terhadap orang seperti ini adalah jika kita sudah memberitakan Injil namun ia terus menolak bahkan melecehkan Injil, maka jangan lagi beritakan Injil kepadanya karena ia malah akan semakin merendahkan martabat Injil dan menghina Allah.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 13.5pt; text-indent: -13.5pt; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><strong style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">3.</span></strong>&nbsp;<strong style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">Sikap terhadap Bapa di Surga (ay. 7-11)</span></strong></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\">Setelah mengajarkan sikap terhadap sesama, maka Yesus beralih kepada hubungan dengan Bapa di surga. Dalam teks ini secara khusus menyorot hubungan dengan Bapa dalam hal pengabulan doa. Frasa ini menunjukkan suatu kedekatan yang erat antara anak dan Bapa dimana sebagai anak kita harus menjalin hubungan yang erat dengan Bapa dalam doa supaya kita dimampukan melakukan perintah-Nya.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\">Ketika kita mengharapkan sesuatu dari Bapa, Yesus mengajarkan untuk &rdquo;mintalah..., carilah..., dan ketoklah....&rdquo; maka Bapa pasti akan memberi yang terbaik. Hal berdoa ini sangat sederhana tetapi mengandung unsur yang sangat penting yang harus kita ketahui dan lakukan:</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 13.5pt; text-indent: -13.5pt; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">a.</span>&nbsp;<strong style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">Pengetahuan</span></strong><span style=\"box-sizing: border-box; border-radius: 0px !important\">. Bapa akan memberi sesuai dengan kehendak-Nya karena itu kita harus tahu apa yang menjadi kehendak-Nya agar doa kita dikabulkan. Cara untuk mengetahui adalah belajar dan merenungkan Firman-Nya serta bersekutu erat dengan-Nya.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 13.5pt; text-indent: -13.5pt; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">b.</span>&nbsp;<strong style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">Iman</span></strong><span style=\"box-sizing: border-box; border-radius: 0px !important\">. Jika kita sudah mengetahui kehendak Bapa maka unsur lain yang perlu ada adalah iman. Kita harus mengimani dan sungguh-sungguh percaya maka pasti Dia akan mengabulkan doa kita sesuai kehendak-Nya.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; margin-left: 13.5pt; text-indent: -13.5pt; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">c.</span>&nbsp;<strong style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; border-radius: 0px !important\">Keinginan</span></strong><span style=\"box-sizing: border-box; border-radius: 0px !important\">. Kita tahu kehendak Bapa, kita mengimani bahwa Bapa pasti memberi, dan memang itu sangat kita inginkan atau butuhkan, percayalah Bapa pasti akan memberikannya.</span></span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"background-color: #ffffff\"><br />\r\n</span>\r\n</div>\r\n<div class=\"MsoNormal\" style=\"box-sizing: border-box; border-radius: 0px !important\">\r\n<span style=\"box-sizing: border-box; border-radius: 0px !important\"><span style=\"box-sizing: border-box; font-family: &quot;Trebuchet MS&quot;, sans-serif; background-color: #ffffff; border-radius: 0px !important\">Marilah kita memiliki sikap yang benar dalam berhubungan dengan sesama kita dan teristimewa dalam hubungan kita dengan Bapa di surga.</span></span>\r\n</div>\r\n</div>\r\n<div>\r\n</div>\r\n','','Kamis','2017-01-26','15:43:44','13images.jpg',472,'renungan,khotbah'),(981,40,'admin','Memberi Makna Kepada Waktu Kita','Memberi Makna Kepada Waktu Kita','','memberi-makna-kepada-waktu-kita','N','N','N','<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Memberi makna kepada waktu kita ~ Hidup kita senantiasa ada di dalam waktu. Tidak satu pun kehidupan di dunia ini yang hidup di luar waktu. Semuanya ada di dalam penjara waktu. Dengan demikian, waktu boleh dikatakan sebagai harta yang paling berharga bagi kita&nbsp;</span><em style=\"outline: 0px; transition: all 0.3s ease; padding: 0px; border: 0px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0px; color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">(time is money)</em><span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">.</span><br />\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Waktu sedang &quot;jaya&quot; kita merasa banyak teman di sekeliling kita. Banyak teman yang mendukung dan mensupport kita. Waktu sedang &quot;berkuasa&quot; kita begitu percaya diri (confidence) melakukan apa saja. Kita seakan memiliki segalanya ketika waktu &quot;berkuasa&quot;. Apa pun yang kita ingikan pasti tercapai dan siapa pun yang kita perintahkan pasti menjalankan apa yang diperintahkan kepadanya.</span><br />\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Waktu sedang &quot;jatuh&quot; kita baru sadar selama ini siapa saja teman yang memperalat dan memanfaatkan kita. Dan kita juga baru sadar siapa sesungguh teman pencundang dan sahabat sejati ketika kita jatuh.</span><br />\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Waktu sedang &quot;sakit&quot; kita baru tahu bahwa sehat itu sangat penting, jauh melebihi harta. Oleh karena itu, jangan pikir sehat itu penting ketika kita sudah sakit, tetapi pikirkan bahwa sehat itu penting waktu sedang sehat. Dengan demikian, kita akan serius dan sungguh-sungguh akan menjaga kesehatan kita.</span><br />\r\n<br />\r\n<div class=\"separator\" style=\"outline: 0px; transition: all 0.3s ease; padding: 0px; border: 0px; vertical-align: baseline; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0px; color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px; clear: both; text-align: center\">\r\n<a style=\"outline: 0px; transition: all 0.3s ease; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px; margin: 0px 1em; color: #27ae60; text-decoration: none; clear: none !important; float: none !important\" href=\"https://2.bp.blogspot.com/-XrJOgFJd2kU/WImolW7DerI/AAAAAAAAEfA/y59SSplX7MQeNfvg9s7eVeR7zsehd0YPgCEw/s1600/time%2528FILEminimizer%2529.jpg\"><img style=\"outline: 0px; transition: all 0.3s ease; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px; margin: 0px; position: relative; max-width: 100%\" src=\"https://2.bp.blogspot.com/-XrJOgFJd2kU/WImolW7DerI/AAAAAAAAEfA/y59SSplX7MQeNfvg9s7eVeR7zsehd0YPgCEw/s400/time%2528FILEminimizer%2529.jpg\" border=\"0\" alt=\"\" width=\"400\" height=\"225\" /></a>\r\n</div>\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Manakala &quot;miskin&quot; kita baru tahu bahwa jadi orang haus banyak memberi dan mendermakan serta saling membantu. Itulah bentuk keterikatan solidaritas sosial dalam hidup kita. Di sinilah kita sadar bahwa betapa berharganya orang lain yang ada di sekitar kita. Karena itu, jangan sia-siakan orang-orang yang ada di sekitar kita dan pernah menahan kebaikan bagi mereka selagi kita bisa melakukannya.</span><br />\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Masuk &quot;usia tua&quot; baru tahu kalau masih banyak yang belum dikerjakan. Oleh karena itu, sadarlah dan gunakan waktu masa mudamu serta isilah dengan hal-hal yang berguna dan bermanfaat bagi kehidupan, sehingga jangan sampai ketika waktu usia sudah tua ternyata Anda sudah tidak lagi punya kesempatan untuk melakukan apa-apa.</span><br />\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Saat &quot;di ambang ajal&quot; baru tahu ternyata banyak waktu yang terbuang sia-sia. Oleh sebab itu, jangan sia-siakan waktu yang Tuhan berikan. Isilah waktu hidup dan kesempatan yang diberi dengan berbuat sebanyak-banyaknya kebaikan kepada sesama. Sehingga ketika ajal menjelang kita tersenyum dan bangga karena waktu hidup kita sudah diisi dengan hal yang bernilai dan bermanfaat bagi kehidupan.</span><br />\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Hidup kita tidaklah lama di dunia ini kalau kita jujur mengatakannya. Oleh karena itu, sudah saatnya kita bersama-sama membuat hidup lebih berharga dengan saling menghargai, saling membantu, saling memberi dan saling mendukung.</span><br />\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Jadilah teman dan sahabat setia bagi sesama selama masih ada waktu. Syaratnya yaitu: jangan saling memtong karena jika ini terjadi tentu sangat menyakitkan dan sulit untuk disambungkan kembali, jangan saling menggunting sesama teman karena itu akan menimbulkan luka yang menganga dan sulit untuk disembuhkan.</span><br />\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Tunjukkanlah bahwa Anda masih mempunyai hati nurani yang tulus. Jauhkan niat jahat untuk mencelakai atau memfitnah teman atau sesama kita. Jauhkan niat memaksa seseorang melakukan sesuatu hal untuk kepentingan pribadi kita.</span><br />\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Apa yang ditabur itulah yang akan dituai jika kondisinya matang. Langit tak selalu biru. Bunga tak selalu mekar. Dan mentari tak selalu bersinar. Tetapi ada pelangi disetiap badai. Ada senyum (hikmah) di setiap airmata. Ada berkah di setiap kesulitan. Dan ada kebijaksanaan setelah kesungguhan berjuang.</span><br />\r\n<br />\r\n<br />\r\n<span style=\"color: #5e5e5e; font-family: &quot;PT Serif&quot;, sans-serif; font-size: 15px\">Jangan pernah menyerah, terus berjuang. Life is so beatiful and colourful. Hidup bukanlah suatu tujuan, melainkan sebuah perjalanan. Saudaraku, indahnya hidup bukan karena banyak orang mengenal kita, namun berapa banyak orang yang bahagia karena kita. Jangan pernah menjadi seperti gunting, karena gunting bisa memotong sesuatu untuk menjadi terpisah. Jadilah laksana jarum, meskipun runcing, tapi bisa menyatukan apa yang sudah terpisah.</span>\r\n','','Kamis','2017-01-26','16:28:02','13images.jpg',427,'dunia-kristen,renungan,khotbah'),(982,55,'admin','Patrialis Ditangkap, Jokowi Diharap Tak Rekrut Politikus Jadi Hakim','Patrialis Ditangkap, Jokowi Diharap Tak Rekrut Politikus Jadi Hakim','','patrialis-ditangkap-jokowi-diharap-tak-rekrut-politikus-jadi-hakim','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Jakarta</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\"> - Hakim konstitusi Patrialis Akbar ditangkap oleh KPK. Merujuk pada jejak Patrialis, yang merupakan eks kader partai, diharapkan Presiden Joko Widodo tidak menunjuk politikus sebagai seorang hakim Mahkamah Konstitusi (MK).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Kalau jabatan publik lainnya, silakan (politikus) ya. Itu kalau kita menunjuk dari referensi politik, misalnya jabatan menteri atau jabatan ketua-ketua lembaga, tapi jangan seorang hakim,\" kata pengamat hukum tata negara Refly Harun saat berbincang dengan </span><strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">detikcom</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">, Kamis (26/1/2017).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Kalau seorang hakim, carilah manusia yang berkualitas, manusia yang tidak banyak dendamnya, manusia yang independen, yang betul-betul mencerminkan hidup sebagai orang yang adil,\" lanjutnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Refly mengatakan, ketika mencari sosok hakim konstitusi, sebaiknya bukan orang yang dekat dengan arus politik presiden ataupun berkaitan dengan kepentingan presiden. Apabila seorang hakim konstitusi dekat dengan kepentingan politik presiden, artinya presiden membangun MK jangka pendek sesuai dengan masa jabatannya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Nanti kalau ada presiden baru, dia cari juga orang yang punya preferensi dengan dirinya. Karena itu, carilah sosok-sosok terbaik yang integritasnya tidak diragukan, yang independensinya tidak diragukan, dan secara pribadi orang yang selama ini, ibarat kata, sulit kalau mau disuap,\" ujar Refly.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Misalnya sosok politisi-politisi agak berat kelihatannya, jangan-jangan upeti, uang-uang</span><em style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\"> thank you </em><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">itu sudah bagian dari kehidupan. Sama seperti Ketua DPD Irman Gusman, menganggap uang Rp 100 juta itu bukan suap, tapi oleh-oleh,\" tambahnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Menurutnya, sebaiknya presiden kembali membentuk tim seleksi (timsel) seperti ketika menunjuk hakim konstitusi I Dewa Gede Palguna untuk mencari hakim konstitusi baru. Timsel berfungsi menyeleksi kandidat calon hakim untuk direkomendasikan kepada presiden.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Refly menjadi salah satu anggota timsel saat pemilihan hakim konstitusi I Dewa Gede Palguna, yang merupakan dosen dari Universitas Udayana, Bali. Dia menjadi salah satu dari dua calon hakim berlatar belakang akademisi yang dipilih oleh timsel untuk diajukan kepada presiden. </span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Kalau dia mempraktikkan cara yang kemarin di mana dia membentuk timsel, hasilnya kan sangat tergantung timsel dan timsel bisa mengajukan dua kali (jumlah calon hakim) dari yang dibutuhkan, misalnya dibutuhkan satu hakim yang diajukan dua, dan kebetulan kemarin yang diajukan kan tidak ada politisi, tapi akademisi. Kita bekerja seobjektif mungkin dan kita mencari calon yang terbaik,\" tutupnya.</span>\r\n','','Jumat','2017-01-27','09:10:50','1re.jpg',322,'politik,hukum'),(983,54,'admin','Pelita Hidup Jangkau Dunia Belajar Mengenal Jalan Allah Bagi Hidup Kita','Pelita Hidup Jangkau Dunia Belajar Mengenal Jalan Allah Bagi Hidup Kita','','pelita-hidup-jangkau-dunia-belajar-mengenal-jalan-allah-bagi-hidup-kita','N','N','N','<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\n<strong style=\"box-sizing: border-box; font-family: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\"><em style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\">Beritahukanlah jalan-jalan-Mu kepadaku, ya TUHAN, tunjukkanlah itu kepadaku.” Mazmur 25:4</em></strong>\r\n</p>\r\n<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\n<strong style=\"box-sizing: border-box; font-family: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\"> Bacaan : Kisah Para Rasul 16:16-34</strong><br />\r\n<span style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent; color: #ffffff\">*courtesy of PelitaHidup.com</span><br />\r\n<strong style=\"box-sizing: border-box; font-family: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\"> </strong>Banyak kali kita cenderung untuk menilai apakah kita benar-benar telah berjalan sesuai dengan kehendak Allah berdasarkan hasil yang terlihat oleh mata. Dalam hal ini, kita berpendapat bahwa jika kita hidup menurut kehendak Allah, maka segala sesuatunya akan berjalan lancar; tetapi jika ternyata kita mengalami berbagai-bagai masalah dan luka hati, kita sering berasumsi bahwa kita sedang menyimpang dari kehendakNya. Benarkah demikian?\r\n</p>\r\n<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\nRasul Paulus mengajar kita bahwa pendapat dan pemikiran di atas tidak selamanya benar; tidak semuanya akan berjalan dengan lancar, baik dan indah ketika ketika kita mengikuti kehendak dan jalan Allah dalam hidup kita. Adakalanya, kita harus mengalami masa sukar, luka hati bahkan penganiayaan ketika kita sedang mengikuti kehendak dan rencanaNya.\r\n</p>\r\n<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\n<strong style=\"box-sizing: border-box; font-family: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\"><em style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\">“sebab di sini banyak kesempatan bagiku untuk mengerjakan pekerjaan yang besar dan penting, sekalipun ada banyak penentang. “ I Korintus 16:9</em></strong>\r\n</p>\r\n<div style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px; padding: 12px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777; float: right\">\r\n<br />\r\n<br />\r\n<ins id=\"aswift_0_expand\" style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: none; outline: 0px; background: transparent; display: inline-table; height: 280px; position: relative; visibility: visible; width: 336px\"><ins id=\"aswift_0_anchor\" style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: none; outline: 0px; background: transparent; display: block; height: 280px; position: relative; visibility: visible; width: 336px\"></ins></ins>\r\n</div>\r\n<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\nDan itulah yang terjadi pada kunjungan misi kedua Rasul Paulus yang menunjukkan bagaimana Allah menutup satu pintu baginya dan membuka pintu yang lain sebagai jalan yang ingin Ia tunjukkan kepada Rasul Paulus. (Lihat di Kisah Rasul 16:6-10)\r\n</p>\r\n<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\nDalam kitab tersebut diceritakan bahwa setelah Lidia, si penjual kain ungu dan seluruh anggota keluarganya menerima Injil keselamatan, kesempatan baru tersebut sepertinya memberikan banyak harapan bagi kedua rasul tersebut. Namun ternyata, tidak berapa lama kemudian, Paulus dan Silas dilucuti pakaiannya dan berkali-kali didera serta dijebloskan ke dalam penjara di Filipi<br />\r\n<span style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent; color: #ffffff\">*courtesy of PelitaHidup.com</span><br />\r\nKita mungkin tidak pernah berpikir bahwa luka hati, penderitaan, penganiayaan dan masa sukar termasuk dalam kehendak Allah atas hidup kita; tetapi itulah yang Alkitab ajarkan kepada kita.\r\n</p>\r\n<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\n<span style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent; text-decoration: underline\"><strong style=\"box-sizing: border-box; font-family: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\"><strong style=\"font-family: inherit; background: transparent; box-sizing: border-box; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px\"><em style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\">“yang menghibur kami dalam segala penderitaan kami, sehingga kami sanggup menghibur mereka, yang berada dalam bermacam-macam penderitaan dengan penghiburan yang kami terima sendiri dari Allah. “ 2 Korintus 1:4</em></strong>Allah menggunakan masa sukar untuk menguji iman kita, untuk mengajar kita agar berserah dan bersandar hanya kepadaNya, untuk membangun karakter ilahi dan kematangan rohani dalam hidup kita serta untuk memperlengkapi kita untuk memberi penghiburan kepada saudara seiman yang mengalami hal serupa yang pernah kita alami. </strong></span><br />\r\n<span style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent; color: #ffffff\">*courtesy of PelitaHidup.com</span><br />\r\n<strong style=\"box-sizing: border-box; font-family: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\"><em style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\">“Dan bukan hanya itu saja. Kita malah bermegah juga dalam kesengsaraan kita, karena kita tahu, bahwa kesengsaraan itu menimbulkan ketekunan, dan ketekunan menimbulkan tahan uji dan tahan uji menimbulkan pengharapan.“ Roma 5:3-4</em></strong>\r\n</p>\r\n<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\nAllah juga menggunakan penderitaan untuk menjangkau jiwa lain mendekat kepada Kristus. Sipir penjara dalam kidah Paulus dan Silas di ata, tentunya tidak akan siap untuk menerima Injil kebenaran kalau Paulus dan Silas tidak memuji-muji Tuhan di dalam penjara sebagai respon dari tindakannya yang tidak adil kepada mereka.\r\n</p>\r\n<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\n<strong style=\"box-sizing: border-box; font-family: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\">Ketika terbuka pintu penderitaan untuk kita alami dalam hidup kita, inilah kesempatan bagi mereka yang tidak percaya untuk menyaksikan karya Allah dalam hidup kita.</strong> Jadi, jika hal itu terjadi atau bahkan sedanga Anda dan saya alami sekarang, jangan lari, marilah kita menanggapi masa sukar kita dengan cara yang benar sehingga jiwa-jiwa bisa melihat karya besar Allah dalam hidup kita dan mendekatkan mereka kepada satu-satunya Juruselamat Dunia, Yesus Kristus Tuhan. Siapkah Anda untuk hal ini?\r\n</p>\r\n<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\n \r\n</p>\r\n<p style=\"box-sizing: border-box; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; vertical-align: baseline; margin: 0px 0px 20px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: #777777\">\r\n<strong style=\"box-sizing: border-box; font-family: inherit; font-style: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\"><em style=\"box-sizing: border-box; font-family: inherit; font-weight: inherit; vertical-align: baseline; margin: 0px; padding: 0px; border: 0px; outline: 0px; background: transparent\">“Segala perkara dapat kutanggung di dalam Dia yang memberi kekuatan kepadaku.” Filipi 4:13</em></strong>\r\n</p>\r\n','','Jumat','2017-01-27','09:22:42','63keluarga kristen memakai satu set kaos yang sama kembaran.jpg',332,'renungan,khotbah,dunia-kristen'),(984,57,'admin','Soal Politik Uang, Ahok: Saya Kira Warga Jakarta Tidak Bodoh','Soal Politik Uang, Ahok: Saya Kira Warga Jakarta Tidak Bodoh','','soal-politik-uang-ahok-saya-kira-warga-jakarta-tidak-bodoh','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Jakarta</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Calon Gubernur DKI Jakarta Basuki Tjahaja Purnama (Ahok) mengajak masyarakat tidak menerima uang dari calon tertentu. Ahok menilai masyarakat Jakarta telah dewasa dalam berpolitik.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Saya kira masyarakat Jakarta nggak bodohlah, orang sekarang juga ekonomi membaik kok.&nbsp;</span><em style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Ngapain</em><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;sih terima beberapa ratus ribu. Terus kan nanti lima tahun ke depan susah,&quot; kata Ahok di Ulujami, Pesanggrahan, Jakarta Selatan, Kamis (26/1/2017).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Ahok juga sudah bekerja sama dengan organisasi masyarakat untuk mencegah politik uang. Ia percaya programnya akan lebih menarik warga.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Kita sejak awal sudah kerja sama berbagi LSM dengan alasan supaya masyarakat juga mengawasi. Kalau jalan kita&nbsp;</span><em style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">beresin</em><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">, harga tanah kamu naik kok. Saya kira programlah akan menarik warga,&quot; katanya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Ahok mengatakan programnya cukup bagus namun tetap realistis. Penggusuran, menurut Ahok, akan tetap dilakukan demi pembangunan Jakarta.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Saya fokus program saja. Saya bilang tidak mungkin kalau tidak bongkar. Kalau ada yang bisa diapungkan, saya juga nggak tahu,&quot; katanya.&nbsp;</span><br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(fdu/imk)</strong>\r\n','','Jumat','2017-01-27','10:42:16','29ju.jpg',184,'daerah,ekonomi,metropolitan,nasional,politik'),(985,41,'admin','Jokowi: Tak Perlu Pertukaran Siswa ke LN, ke Provinsi Lain Saja','Jokowi: Tak Perlu Pertukaran Siswa ke LN, ke Provinsi Lain Saja','','jokowi-tak-perlu-pertukaran-siswa-ke-ln-ke-provinsi-lain-saja','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Jakarta</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Presiden Jokowi menilai sekolah-sekolah di Indonesia tak perlu menggalakkan pengiriman siswa ke luar negeri (LN) untuk pertukaran pelajar. Untuk saat ini, lebih baik pertukaran pelajar ke provinsi lain saja untuk merawat kebhinnekaan.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Kalau yang di luar saya melihat overseas experience, mereka kirim anak-anak SD, SMP, atau SMA ke luar negeri untuk melihat negara lain. Kalau kita mungkin tidak perlulah ke luar,&quot; kata Jokowi saat memberi sambutan pembukaan Rembuk Nasional Pendidikan dan Kebudayaan 2017 di Jakarta International Expo (JIExpo), Kemayoran, Jakarta Pusat, Kamis (26/1/2017).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Peserta Rembuknas berasal dari internal Kementerian Pendidikan, kepala dinas pendidikan seluruh Indonesia, organisasi guru, UPT kebudayaan, Lembaga Sensor Film, hingga dewan kesenian tingkat provinsi.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pertukaran pelajar antarprovinsi perlu untuk menumbuhkan pengalaman siswa, utamanya untuk memupuk rasa persaudaraan antardaerah.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Anak-anak diajak ke provinisi yang lain untuk mengenalkan saudara-saudaranya yang berada di pulau yang lain. Ini akan sangat baik untuk kebihinnekaan kita, keberagaman kita, untuk memperkaya wawasan anak-anak kita agar mereka tidak hanya mengerti kabupatennya atau tempatnya masing-masing. Ini penting,&quot; tutur Jokowi.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Siswa sekolah juga tetap perlu diingatkan dengan nasionalisme. Setiap memulai pelajaran di kelas, Jokowi meminta guru-guru mengajak menyanyikan lagu kebangsaan Indonesia Raya dan menyebutkan Pancasila.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Kalau tidak, kita lupa bahwa kita ini memiliki lebih dari 700 suku. Catatan saya ada 1.100 lebih bahasa lokal. Kebhinnekaan ini yang perlu kita ingatkan kepada anak-anak,&quot; kata Jokowi.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Kegiatan sosial untuk para siswa juga perlu dirancang. Dia menyebutkan contohnya, akan baik bila siswa diajak berkunjung ke panti jompo, atau sekadar bersih-bersih kampung sekitar sekolah. Gunanya untuk menumbuhkan pengertian nilai sosial dan budaya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Hal-hal seperti ini dinilainya penting, karena konteks zaman saat ini sedang rawan perang budaya. Maka mentalitas anak Indonesia harus dibentuk sejak dini lewat kegiatan yang memupuk nilai-nilai persatuan berwawasan kebangsaan.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Hati-hati. Jadi yang akan terjadi nantinya adalah perang budaya, perang ekonomi, perang keuangan, perang informasi, perang dalam membangun sebuah persepsi,&quot; kata Jokowi.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Maka jalan terbaiknya adalah menguatkan generasi muda. Dengan demikian serangan budaya hingga modal dari luar bisa disikapi dengan bijaksana.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Inilah yang perlu saya tekankan agar anak-anak kita dibekali dengan karakter-karakter ke-Indonesiaan yang baik sehingga masuknya budaya, arus finansial ke negara kita betul-betul kita pagari. Anak-anak kita betul-betul kita pagari agar jangan sampai terbawa arus budaya negara lain sehingga kita kehilangan jati diri,&quot; tuturnya.</span>\r\n','','Jumat','2017-01-27','10:57:03','507fd836fa-dc1d-4b26-a001-09a0c16151dd_169.jpg',201,'daerah,metropolitan,nasional'),(986,31,'admin','Manfaatkan Libur Tahun Baru di Pantai agar Lebih Sehat','Manfaatkan Libur Tahun Baru di Pantai agar Lebih Sehat','','manfaatkan-libur-tahun-baru-di-pantai-agar-lebih-sehat','N','N','N','<p style=\"box-sizing: border-box; margin-top: 0px; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\nKe mana Anda akan berlibur pada&nbsp;<a style=\"box-sizing: border-box; background-color: transparent; color: #f67638; text-decoration: none\" href=\"http://news.liputan6.com/read/2690942/transjakarta-operasikan-300-bus-saat-malam-tahun-baru-2017\">tahun baru&nbsp;</a>nanti? Bila belum ada rencana, mungkin Anda bisa mempertimbangkan untuk berlibur di pantai. Sebab belum lama ini para ahli kesehatan merekomendasikan laut sebagai bagian dari terapi kesehatan.\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\nSeperti dilansir&nbsp;<em style=\"box-sizing: border-box\">Daily Mail,</em>&nbsp;Kamis (29/12/2016), Direktur Medis dari The Maitland and Kurri Kurri Hospital, University of Newcastle,&nbsp;Sergio Diez Alvarez mengatakan sejumlah manfaat kesehatan dari air laut. Mulai dari menenangkan kulit, mengatasi sinus, mengatasi kondisi kulit seperti psoriasis, eksim dan gangguan imun lainnya.\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\nSaat itu, ia menganjurkan pasiennya untuk minum air laut serta berenang di lautan. Menurutnya, air laut kaya akan kandungan mineral garam yang bisa menjadi antiseptik. Selain itu, air laut juga mengandung sodium, kloride, sulfat, magnesium dan kalsium yang mampu menangkal penyakit.Menggunakan air laut untuk tujuan medis bahkan memiliki istilah yang cukup terkenal atau disebut thalassotherapy. Hal ini bermula pada 1769, seorang dokter Inggris populer Richard Russell menerbitkan disertasi soal pengobatan penyakit seperti scurvy (gangguan nutrisi yang disebabkan oleh defisiensi vitamin C), Jaundice (perubahan warna kuning pada kulit dan mata bayi yang baru lahir), kusta, serta demam kelenjar.\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\nTak heran, saat ini penawaran untuk terapi air laut kian melimpah. Bahkan pemandian alam dengan air kaya mineral juga dinilai mampu mengobati psoriasis atau dikenal dengan Balneotherapy.\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\nAda juga bukti&nbsp;yang menunjukkan, berenang di laut bisa menurunkan demam dan sinusitis dan gejala pernapasan lainnya. Hal ini karena efek garam pada lapisan sinus dapat mengurangi peradangan, meskipun bukti ilmiah untuk ini kurang kuat.\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\nItu sebabnya, Direktur layanan klinis&nbsp;untuk alergi di Inggris mengklaim orang-orang yang hidup di pinggir pantai cenderung memiliki sistem pernapasan yang sehat.Dia mengatakan karena udara di pantai dan air laut dapat&nbsp;meniru cairan tubuh sendiri&nbsp;sehingga rongga pernapasan jadi lebih sehat.\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\nTak cukup sampai di situ, pada 2014, seorang ahli biologi kelautan&nbsp;Wallace J. Nichols membuktikan kekuatan laut untuk meditasi dan mengurangi stres.\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\n&quot;Meditasi dan santai di dalam air laut akan melatih pernapasan dan merangsang&nbsp;sistem saraf parasimpatis (sistem yang mengontrol fungsi organ dan mendiamkan otak). Hal ini menimbulkan efek pada gelombang otak dan hormon yang mempengaruhi otak secara positif,&quot; ujarnya.\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\nDesiran ombak di laut&nbsp;juga dapat memiliki efek menenangkan pikiran, bahkan mengubah atau memperlambat gelombang otak.&nbsp;\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\nDalam satu studi, para ahli kesehatan bahkan menunjukkan efek balneotherapy yang sebanding dengan obat anti-depresan obat yang disebut paroxetine.\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #4a4a4a; font-family: AcuminPro, arial, helvetica, sans-serif; font-size: 14px\">\r\n&quot;Hidroterapi telah banyak digunakan dalam rehabilitasi, tapi di sini saya akan fokus pada manfaat kesehatan dari berenang di air laut dingin. Sebab air dingin dapat mengaktifkan reseptor suhu di bawah kulit yang melepaskan hormon seperti endorfin, adrenalin dan kortisol,&quot; kata&nbsp;Nichols.\r\n</p>\r\n','','Jumat','2017-01-27','14:28:11','39046372900_1419492153-berenang (1).jpg',192,'gaya-hidup,kesehatan,seni--budaya'),(989,23,'admin','Brooklyn Beckham Jadi Korban Kejahilan Sang Bapak Saat Sedang Menggunakan Fitur Terbaru Instagram','Brooklyn Beckham Jadi Korban Kejahilan Sang Bapak Saat Sedang Menggunakan Fitur Terbaru Instagram','','brooklyn-beckham-jadi-korban-kejahilan-sang-bapak-saat-sedang-menggunakan-fitur-terbaru-instagram','N','N','N','<p style=\"box-sizing: border-box; color: #585858; font-family: NotoSans; font-size: 14px; letter-spacing: -0.342px\">\r\nKalau kamu termasuk orang yang <em style=\"box-sizing: border-box\">update </em>dengan perkembangan media sosial, pasti kamu sudah tahu dan bahkan mungkin mencoba fitur terbaru yang ada di Instagram, <a style=\"box-sizing: border-box; background-color: transparent; text-decoration: none; transition: all 0.18s cubic-bezier(0.33, 0.66, 0.66, 1); border-bottom: 1px solid #f8af5b; box-shadow: #f8af5b 0px -1px 0px inset !important\" href=\"http://www.hipwee.com/hiburan/mulai-hari-ini-kamu-bisa-menggunakan-fitur-siaran-langsung-dari-instagram-coba-yuk-biar-kekinian/\"><em style=\"box-sizing: border-box\">Live Stories</em></a>. Jika sebelumnya fitur ini hanya bisa digunakan oleh akun-akun tertentu, sejak kemarin (25/1) semua pengguna Instagram di beberapa negara sudah bisa ikut menggunakannya, termasuk di Indonesia. Hal ini tentu menjadi sebuah pengalaman baru bagi pengguna Instagram yang berasal dari kalangan “biasa”.\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #585858; font-family: NotoSans; font-size: 14px; letter-spacing: -0.342px\">\r\nSebagai fitur baru, tentu kamu penasaran ‘kan bagaimana rasanya menggunakan <em style=\"box-sizing: border-box\">Live Stories?</em> Sekilas, penggunaannya sama dengan <a style=\"box-sizing: border-box; background-color: transparent; text-decoration: none; transition: all 0.18s cubic-bezier(0.33, 0.66, 0.66, 1); border-bottom: 1px solid #f8af5b; box-shadow: #f8af5b 0px -1px 0px inset !important\" href=\"http://www.hipwee.com/hiburan/duh-7-fitur-terbaru-ini-bakal-bikin-kamu-makin-posesif-sama-facebook-di-tahun-2017-awas-kecanduan/\">Facebook</a> Live ataupun Periscope dengan perbedaan pada beberapa detail. Kamu bisa merekam kegiatan yang sedang kamu lakukan dan pengikut akunmu juga bisa menontonnya secara langsung. Bukan hanya itu, para pengikutmu yang sedang ikut menyaksikan juga bisa mengirimkan <em style=\"box-sizing: border-box\">chat </em>yang akan keluar di layar. Seru bukan?\r\n</p>\r\n<p style=\"box-sizing: border-box; color: #585858; font-family: NotoSans; font-size: 14px; letter-spacing: -0.342px\">\r\n<ins id=\"aswift_0_expand\" style=\"letter-spacing: -0.342px; text-align: center; background-color: transparent; box-sizing: border-box; display: inline-table; border: none; height: 60px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 689px\"><ins id=\"aswift_0_anchor\" style=\"box-sizing: border-box; display: block; border: none; height: 60px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 689px; background-color: transparent\"><span style=\"background-color: transparent; letter-spacing: -0.342px\">Tapi hati-hati, terutama untuk kamu yang saling</span><span style=\"background-color: transparent; letter-spacing: -0.342px\"> </span><em style=\"background-color: transparent; letter-spacing: -0.342px; box-sizing: border-box\">follow</em><span style=\"background-color: transparent; letter-spacing: -0.342px\"> </span><span style=\"background-color: transparent; letter-spacing: -0.342px\">Instagram dengan keluarga terutama orang tua. Jangan sampai kamu kena iseng seperti yang dilakukan oleh David Beckham ke anaknya. Bikin malu sih, tapi kocak juga.</span><span style=\"background-color: transparent; letter-spacing: -0.342px\"> </span><del style=\"background-color: transparent; letter-spacing: -0.342px; box-sizing: border-box\">Duh, jadi pengen punya papa kayak David Beckham #oops</del></ins></ins>\r\n</p>\r\n<h3 style=\"box-sizing: border-box; font-family: Bitter, Georgia, Times, serif; line-height: 1.42857; font-size: 16px; color: #585858; letter-spacing: -0.342px\">Seperti anak muda lainnya yang ingin selalu dibilang kekinian, Brooklyn Beckham pun asyik menjajal Live Stories di akun Instagram-nya</h3>\r\n<div id=\"attachment_405769\" class=\"wp-caption aligncenter\" style=\"box-sizing: border-box; position: relative; max-width: 100%; display: table; margin: 0px auto; color: #585858; font-family: NotoSans; font-size: 14px; letter-spacing: -0.342px\">\r\n<img style=\"box-sizing: border-box; color: transparent; border: 0px; vertical-align: middle; max-width: 100%; width: 640px; display: block; height: auto\" class=\"size-full wp-image-405769\" src=\"http://image-serve.hipwee.com/wp-content/uploads/2017/01/hipwee-15876653_1669580763339412_674649825018380288_n.jpg\" alt=\"David Beckham danBrooklyn Beckham\" width=\"640\" height=\"640\" />\r\n<p style=\"box-sizing: border-box; color: #5c5c5c; font-family: Bitter, Georgia, Times, serif; font-size: 13px; font-style: italic; margin-top: 0px\" class=\"wp-caption-text\">\r\nDavid Beckham danBrooklyn Beckham via <a style=\"box-sizing: border-box; background-color: transparent; text-decoration: none; transition: all 0.18s cubic-bezier(0.33, 0.66, 0.66, 1); border-bottom: 1px solid #f8af5b; word-break: break-word; word-wrap: break-word; box-shadow: #f8af5b 0px -1px 0px inset !important\" href=\"https://www.instagram.com/brooklynbeckham/\" target=\"new\">www.instagram.com</a>\r\n</p>\r\n</div>\r\n<p style=\"box-sizing: border-box; color: #585858; font-family: NotoSans; font-size: 14px; letter-spacing: -0.342px\">\r\nBrooklyn Beckham yang merupakan anak sulung dari mantan pemain bola handal, David Beckham, memiliki penggemar yang cukup banyak. Hal ini tampak dari banyaknya jumlah pengikut Brooklyn di media sosial. Wajar sih, wajahnya memang tampan tak jauh beda dari bapaknya. Beberapa hari lalu, cowok berusia 17 tahun ini tampak sedang <em style=\"box-sizing: border-box\">live </em>menggunakan Instagram Stories-nya. Ia sepertinya ingin menyapa dan memenuhi keinginan para penggemarnya yang ingin kontak langsung melalui Live Stories. Lebih dari 10 ribu orang menonton siaran langsung yang ia lakukan.\r\n</p>\r\n','','Jumat','2017-01-27','14:48:00','32hipwee-beck-horz.jpg',148,'');
INSERT INTO `berita` VALUES (990,56,'admin','Bocornya Draf Putusan MK ke Tangan Makelar','Hakim Mahkamah Konstitusi (MK) Patrialis Akbar, digiring ke Mobil Tahaanan usai menjalani pemeriksaa','','bocornya-draf-putusan-mk-ke-tangan-makelar','N','N','N','<p style=\"margin: 0px 0px 19px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">\r\n<font style=\"background-color: #ffffff\"><strong>JAKARTA, GRESNEWS.COM</strong>&nbsp;- Komisi Pemberantasan Korupsi (KPK) akhirnya mengungkap misteri korupsi yang dilakukan Hakim Mahkamah Konstitusi Patrialis Akbar. Korupsi itu berkaitan dengan permohonan uji materi Undang-Undang Nomor 41 Tahun 2014 tentang Peternakan dan Kesehatan Hewan yang diajukan sejumlah pihak. Dibalik pengajuan uji materi itu ada seorang pengusaha importir daging yang berupaya mempengaruhi Mahkamah Konstitusi dalam memutus perkara tersebut. Pemberian suap itu dimaksudkan agar putusan lebih menguntungkan pengusaha importir daging.<br />\r\n<br />\r\nPernyataan itu diungkapkan pimpinan KPK dalam jumpa pers terkait aksi operasi tangkap tangan, terhadap hakim Konstitusi Patrialis Akbar bersama 10 orang lainnya, Kamis (26/1). Pihak KPK juga secara resmi telah menetapkan empat orang sebagai tersangka yakni Patrialis Akbar, teman dekat Patrialis bernama Kamaluddin, seorang pengusaha Basuki Hariman serta sekretarisnya Ng Fenny.<br />\r\n<br />\r\nWakil Ketua KPK Basaria Panjaitan mengungkapkan kasus korupsi ini berkaitan dengan uji materi Undang-Undang Nomor 41 Tahun 2014 tentang Peternakan dan Kesehatan Hewan. Perkara ini sendiri diketahui belum dibacakan secara resmi oleh MK dimana Patrialis merupakan salah satu hakim pengadil.<br />\r\n<br />\r\nBasariah menjelaskan kronologi penangkapan bermula dari laporan masyarakat. Setelah menerima laporan dari masyarakat tentang adanya dugaan tindak pidana korupsi yang melibatkan penyelenggara negara tim penyidik langsung bergerak melakukan penangkapan.</font>\r\n</p>\r\n<ins class=\"adsbygoogle\" style=\"display: inline-block; width: 336px; height: 280px\"><ins id=\"aswift_1_expand\" style=\"display: inline-table; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px\"><ins id=\"aswift_1_anchor\" style=\"display: block; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px\"><font style=\"background-color: #ffffff\"></font></ins></ins></ins><font style=\"background-color: #ffffff\"><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">&quot;Oleh tim KPK kemudian 11 orang diamankan dalam OTT pada Rabu, 25 Januari 2017 sekitar pukul 10.00 WIB hingga 21.30 WIB malam, dari tiga lokasi berbeda,&quot; kata Basaria di kantornya, Kamis (26/1) malam.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Pihak pertama yang disasar oleh penyidik adalah Kamaluddin. Ia disergap di sebuah lapangan golf di kawasan Rawamangun, Jakarta Timur. Kamaluddin merupakan penghubung antara Basuki Hariman dengan Patrialis. Ia diketahui merupakan orang dekat dari Patrialis.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Selanjutnya setelah mendapat keterangan dari Kamaluddin tim kemudian bergerak ke kantor Basuki di kawasan Sunter, Jakarta Utara dan mengamankan pengusaha yang bergerak di bidang impor daging ini bersama sekretarisnya Ng Fenny bersama 6 karyawan lain.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">&quot;BHR (Basuki) ini memiliki sekitar 20 perusahaan yang bergerak di bidang impor daging,&quot; terang Basaria.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Kemudian pada Pukul 21.30 WIB, penyidik bergerak untuk mengamankan Patrialis yang diketahui sedang berada di pusat perbelanjaan Grand Indonesia di kawasan Jakarta Pusat. Saat ditangkap Patrialis tidak sendiri, saat itu ia bersama seorang wanita. Namun saat ditanya siapa wanita tersebut dan apa hubungannya dengan Patrialis, KPK enggan mengungkapkan.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">&quot;Tidak ada hubungan dengan materi kasus tidak perlu dijelaskan. ini kasus yang berhubungan dengan Tipikor, tidak ada dengan pidana kesusilaan, tidak perlu dijelaskan,&quot; kata Wakil Ketua KPK lainnya Laode Muhamad Syarif.</span><br />\r\n<br />\r\n<br />\r\n<strong style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">DRAF PUTUSAN MK BOCOR</strong><span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">&nbsp;- Basaria juga menyebut jika suap yang dilakukan Basuki ini pada awalnya memang hanya terkait dengan permohonan uji materi Undang-Undang Nomor 41 Tahun 2014 tentang Peternakan dan Kesehatan Hewan.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Tetapi Basaria menduga ada maksud yang lebih besar jika undang-undang tersebut diputus sesuai kehendak dari Basuki. &quot;Hal ini dilakukan oleh BHR dan MGF agar bisnis impor daging dapat lebih lancar,&quot; terang Basaria.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Selanjutnya setelah pembicaraan antar keduanya, Patrialis sepakat untuk membantu agar permohonan sesuai dengan keinginan. Sebagai ganjaran dari kesepakatan itu Patrialis menerima uang US$20 ribu secara tunai dan Sin$200 ribu dalam bentuk voucher.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Setelah pembicaraan Patrialis akan membantu agar permohonan nomor 129/pu dapat dikabulkan MK. Patrialis terima hadiah US$ 20 ribu dan Sin$200 ribu.&nbsp;</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">&quot;Dalam kegiatan ini KPK mengamankan dokumen pembukuan perusahaan dan Voucher pembelian mata uang asing dan draft perkara putusan,&quot; tutur Basaria.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Setelah melakukan pemeriksaan secara intensif, KPK akhirnya menetapkan 4 orang sebagai tersangka. Patrialis Akbar selaku Hakim Konstitusi serta rekannya Kamaluddin dijerat dengan Pasal 12 huruf c atau Pasal 11 Undang-Undang Nomor 31/99 yang telah diubah dengan Undang-Undang Nomor 20/2001 tentang pemberantasan korupsi juncto Pasal 55 ayat (1) ke-1 KUHPidana.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Dalam aturan hukum ini, seorang hakim yang menerima hadiah atau janji untuk mempengaruhi putusan diancam dengan penjara selama seumur hidup atau paling singkat 4 tahun denda Rp200 juta dan maksimal 20 tahun dengan denda Rp1 miliar.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Sedangkan Basuki Hariman dan sekretarisnya Ng Fenny dijerat dengan Pasal 6 ayat (1) huruf a atau Pasal 13 Undang-Undang Nomor 31/99 yang telah diubah dengan Undang-Undang Nomor 20/2001 tentang pemberantasan korupsi juncto Pasal 55 ayat (1) ke-1 KUHPidana dengan ancaman minimal 3 tahun denda Rp150 juta dan maksimal 15 tahun denda Rp750 juta.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Dari beberapa dokumen yang disita ada satu hal yang cukup menarik perhatian yaitu mengenai draft putusan dari perkara tersebut. Meskipun putusan belum dibacakan, tetapi KPK menyita draft putusan ini bukan dari Patrialis, melainkan dari tangan Kamaluddin yang notabene bukan merupakan hakim MK dan hanya pihak swasta. Dalam artian Draf yang diduga merupakan produk Mahkamah Kosntitusi telah bocor kepihak lain.</span><br />\r\n<br />\r\n<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">&quot;Kita menyita draft putusan itu dari penangkapan pertama yang di lapangan golf Rawamangun (dari Kamaluddin),&quot; ujar Juru Bicara KPK Febri Diansyah.</span></font>\r\n','','Jumat','2017-01-27','16:36:14','1showimg.jpg',173,'hukum,metropolitan,nasional'),(991,56,'admin','Kasus Cessie Victoria Mangkrak? ','Gedung Kejaksaan Agung (Edy Susanto/Grenews.com)','','masa-cekal-mumin-ali-gunawan-habis-kasus-cessie-victoria-mangkrak-','N','N','N','<p style=\"margin: 0px 0px 19px; color: #868991; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">\r\n<span style=\"background-color: #ffffff\"><strong>JAKARTA, GRESNEWS.COM -</strong>&nbsp;Status larangan bepergian ke luar negeri saksi kasus dugaan korupsi penjualan hak tagih utang (Cessie) PT Adyesta Ciptatama (AC) di Bank BTN pada BPPN kepada PT Victoria Securities Internasional Corporation (VSIC), Mu&#39;min Ali Gunawan bakal habis. Mu&#39;min yang merupakan ipar dari Mochtar Riady punya peran penting dalam kasus ini diduga bakal lolos.<br />\r\n<br />\r\nSaat ini tim penyidik masih menelusuri dugaan keterlibatan Presiden Komisaris &lrm;Bank Panin ini. Ada bukti-bukti yang mengarah dugaan keterlibatan Presiden Komisaris Bank Panin (Tbk) ini. &quot;Ada (dugaan keterlibatan Mu&#39;min), tapi kita belum berkesimpulan ke sana&lrm;,&quot; kata Jaksa Agung Muda Pidana Khusus (Jampidsus), Arminsyah di Kejaksaan Agung, Jakarta, Kamis (26/1).<br />\r\n<br />\r\nKini status Mu&#39;min Ali Gunawan masih sebagai saksi dan telah dilakukan pencegahan berpergian ke luar negari, bahkan pencegahan Mu&#39;min &lrm;hingga ini dalam tahap perpanjangan dan akan berakhir dalam waktu dekat.<br />\r\n<br />\r\nBahkan dengan habis masa waktu pencegahan, Mu&#39;min bakal bebas melenggang ke luar negeri. &quot;&lrm;Ya mau apa, ketentuannya begitu, kami pengen ketentuannya cekal itu bisa lebih dari 2 kali 6 bulan, tapi ketentuannya gitu 2 kali 6 bulan,&quot; kata Armin.</span>\r\n</p>\r\n<br />\r\n<p>\r\n<span style=\"background-color: #ffffff\"><span style=\"color: #868991; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Dalam kasus ini Kejaksaan Agung telah menetapkan empat tersangka. Mereka adalah Haryanto Tanudjaja (Analis Kredit BPPN), Suzana Tanojoh (Komisaris PT Victoria Sekuritas Insonesia-VSI) dan Rita Rosela (Direktur PT VSI). Ketiganya status buron. Satu lagi mantan Kepala BPPN Syarifuddin Temenggung.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #868991; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Sementara itu, Direktur Penyidikan pada Jaksa Agung Muda Pidana Khusus, Fadil Jumhana mengatakan, dari bukti-bukti penyidik pidana khusus ada keterlibatan Mu&#39;min. Kini penyidik menunggu keterangan tersangka yang saat ini dinyatakan buron.</span><br />\r\n<br />\r\n<span style=\"color: #868991; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">&quot;Kalau sudah ada bukti kuat kenapa tidak, penyidik akan ambil sikap,&quot; kata Fadil beberapa waktu lalu.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #868991; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Dalam kasus Cessie ini terlihat jelas ada pidana korupsinya. Kasus ini mencuat setelah adanya penurunan nilai penjualan aset dari Rp69 miliar menjadi Rp26 miliar. Nilai Rp69 miliar diperoleh saat lelang aset di BPPN dan dimenangkan taipan Prajogo Pangestu.</span><br />\r\n<br />\r\n<span style=\"color: #868991; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Namun, karena surat tidak lengkap, Prajogo dalam kapasitas pemilik PT First Kapital membatalkan kemenangan. Lalu. Dilelang lagi, VSIC sebagai pemenang dengan harga Rp26 miliar. Padahal, menurut anggota tim penyidik harga tanah seluas itu, di pinggir jalan tol Karawang sudah mencapai Rp2,2 triliun. Taksiran penyidik kerugian negaranya mencapai Rp419 miliar.</span><br />\r\n<br />\r\n<span style=\"color: #868991; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Kasus ini berawal saat PT Adyasta Ciptama (AC) mengajukan kredit senilai Rp469 miliar untuk membangun perumahan seluas 1.200 hektare di Karawang, Jawa Barat, ke salah satu bank pemerintah. Saat krisis moneter, bank yang memberikan pinjaman itu termasuk program penyehatan BPPN sehingga asetnya yang terkait kredit macet dilelang termasuk PT AC yang dibeli PT VS Indonesia senilai Rp26 miliar.</span><br />\r\n<br />\r\n<span style=\"color: #868991; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px\">Namun, ketika PT AC akan membeli kembali, PT VS Indonesia menetapkan harga senilai Rp2,1 triliun. Akhirnya, PT AC melaporkan dugaan permainan dalam transaksi ini ke Kejaksaan Agung.&nbsp;</span></span>\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n','','Jumat','2017-01-27','17:10:44','28showimg (1).jpg',155,'hukum,metropolitan,nasional'),(994,56,'admin','Bareskrim Panggil Sylvi Terkait Kasus Masjid Al-Fauz Hari Ini','Bareskrim Panggil Sylvi Terkait Kasus Masjid Al-Fauz Hari Ini','','bareskrim-panggil-sylvi-terkait-kasus-masjid-alfauz-hari-ini','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Jakarta</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Direktorat Tindak Pidana Korupsi Bareskrim Polri hari ini memanggil Sylviana Murni. Sylvi akan dimintai keterangan terkait kasus dugaan korupsi pembangunan Masjid Al-Fauz di kompleks Wali Kota Jakarta Pusat.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pemeriksaan tersebut akan dilakukan di kantor Bareskrim sementara di Gedung Ombudsman, Kuningan, Jakarta Selatan, Senin (30/1/2017). Sylvi diperiksa sebagai saksi dalam kasus ini.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Kepala Bagian Penerangan Umum Divisi Humas Polri Kombes Martinus Sitompul mengatakan penyidik telah meningkatkan status kasus ini ke tahap penyidikan. Namun, belum ada yang ditetapkan sebagai tersangka dalam kasus ini.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Sylvi hari Senin (30/1) sebagai saksi. Itu yang dana masjid ya,&quot; kata Martinus saat dihubungi detikcom, Kamis (26/1/2017) lalu.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Sebelumnya, Sekda DKI Saefullah juga telah diperiksa penyidik. Sylviana Murni menjabat Wali Kota Jakarta Pusat pada 2008-2010 dan digantikan oleh Saefullah pada 2010-2014. Sedangkan Masjid Al-Fauz diresmikan pada 30 Januari 2011 oleh Gubernur DKI Jakarta saat itu, Fauzi Bowo.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Partai Demokrat (PD) memberikan tanggapan tentang dipanggilnya Calon Wakil Gubernur DKI Jakarta Sylviana Murni. Sylvi adalah pasangan Agus Yudhoyono yang diusung oleh PD dan tiga partai lainnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">PD menganggap ada kekeliruan dipanggilnya Sylvi. Pemangilan itu dianggap sebagai bentuk kriminalisasi. PD juga akan membentuk tim untuk mendampingi Sylvi. Tim dibentuk untuk memperjuangkan Sylvi yang diyakini tak bersalah dalam kasus ini.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;DPP Partai Demokrat mempersiapkan dengan betul timnya untuk mendampingi, membela, dan melakukan kajian khusus dalam kasus ini. Kami percaya tidak ada kasus hukum yang melibatkan Sylviana Murni. Kami sampaikan respons kami yang keras,&quot; Sekjen PD Hinca Pandjaitan, kepada wartawan di Kantor DPP PD, Jl Proklamasi 41, Jakarta, Jumat (27/1).&nbsp;</span>\r\n','','Senin','2017-01-30','09:48:08','719148b5e4-c352-4dd2-8075-ee7e7bdb61be_169.jpg',50,'hukum,nasional'),(995,58,'admin','Hujan Deras, Jalan Protokol di Makassar Tergenang','Hujan Deras, Jalan Protokol di Makassar Tergenang','','hujan-deras-jalan-protokol-di-makassar-tergenang','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Makassar</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Sejumlah jalan protokol dan kawasan pemukiman di Makassar tergenang air akibat hujan deras. Beberapa motor mogok dan pengendara terpaksa mencari jalan alternatif.</span><br />\r\n<table border=\"0\" class=\"pic_artikel_sisip_table\" align=\"center\" style=\"text-align: center; margin-bottom: 10px; color: #929292; font-size: 12px; line-height: 14.4px; width: 540px; table-layout: fixed; font-family: helvetica, arial\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div class=\"pic_artikel_sisip\" align=\"center\" style=\"margin-bottom: 25px; font-size: 12px; line-height: 14.4px; width: 534px\">\r\n\t\t\t<div class=\"pic\" style=\"position: relative; display: inline-block; width: 540px; max-width: 100%; background: #f9f9f9; padding-bottom: 10px\">\r\n\t\t\t<img style=\"max-width: 100%; overflow: hidden; margin-bottom: 5px; display: block; margin-left: auto; margin-right: auto; height: auto !important\" src=\"https://images.detik.com/community/media/visual/2017/01/30/e6f4783d-2817-49c6-a3e4-95fa2e904ea2_169.jpg?w=620\" alt=\"Genangan air di jalan protokol di Makassar.\" />Genangan air di jalan protokol di Makassar. Foto: Muhammad Nur Abdurrahman/detikcom\r\n\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Hujan deras mengguyur sejak Minggu 29 Januari malam hingga Senin (30/1/2017) pagi. Pengamatan detikcom, genangan air setinggi 30 centimeter hingga 50 centimeter menghiasi Jalan AP Pettarani, Jalan Urip Sumoharjo, Jalan Sultan Alauddin, Jalan Malengkeri dan Jalan Hertasning.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Beberapa pengendara sepeda motor terpaksa mendorong motornya akibat mogok. Terlihat pula pengemudi mobil sedan dan city-car memilih putar balik di Jalan Hertasning-Yusuf Dg Ngawing. Akibat genangan ini terjadi kemacetan sepanjang 2 kilometer di Jalan Sultan Alauddin menuju Sungguminasa, Kabupaten Gowa.</span><br />\r\n<table border=\"0\" class=\"pic_artikel_sisip_table\" align=\"center\" style=\"text-align: center; margin-bottom: 10px; color: #929292; font-size: 12px; line-height: 14.4px; width: 540px; table-layout: fixed; font-family: helvetica, arial\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div class=\"pic_artikel_sisip\" align=\"center\" style=\"margin-bottom: 25px; font-size: 12px; line-height: 14.4px; width: 534px\">\r\n\t\t\t<div class=\"pic\" style=\"position: relative; display: inline-block; width: 540px; max-width: 100%; background: #f9f9f9; padding-bottom: 10px\">\r\n\t\t\t<img style=\"max-width: 100%; overflow: hidden; margin-bottom: 5px; display: block; margin-left: auto; margin-right: auto; height: auto !important\" src=\"https://images.detik.com/community/media/visual/2017/01/30/3c169aa6-b4a0-455f-9f52-9b7a7c23ce7e_169.jpg?w=620\" alt=\"Pengendara mencari jalan alternatif.\" />Pengendara mencari jalan alternatif. Foto: Muhammad Nur Abdurrahman/detikcom\r\n\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n<br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pengendara motor dan mobil terlihat menempuh jalur alternatif menuju dan dari Gowa. Pengendara yang melintasi kawasan perumahan dan mengakibatkan kemacetan saat jam berangkat ke kantor dan sekolah tersebut.&nbsp;</span>\r\n','','Senin','2017-01-30','09:49:41','98082061bd-afdb-4201-b782-95bd7b9bc756_169.jpg',94,'daerah,nasional'),(996,39,'admin','Kebijakan Imigrasi Dikecam, Trump: Ini Bukan Larangan Muslim','Kebijakan Imigrasi Dikecam, Trump: Ini Bukan Larangan Muslim','','kebijakan-imigrasi-dikecam-trump-ini-bukan-larangan-muslim','N','N','N','<p>\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">(AS) Donald Trump bersikeras mempertahankan kebijakannya untuk melarang warga dari tujuh negara mayoritas muslim masuk ke wilayah AS. Trump juga menyebut larangan ini bukan &#39;larangan muslim&#39;.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Amerika merupakan negara yang bangga akan imigran dan kami akan terus menunjukkan belas kasih pada orang-orang melarikan diri dari penindasan, tapi kami akan melakukannya sembari melindungi warga negara dan perbatasan kami. Amerika selalu menjadi tanah kebebasan dan rumah bagi para pemberani,&quot; demikian ucap Presiden Trump dalam pernyataannya, seperti dilansir&nbsp;</span><em style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">AFP</em><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">, Senin (30/1/2017).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Ini bukan soal agama -- ini menyangkut soal teror dan menjaga negara kita tetap aman,&quot; imbuhnya, sembari menyebut bahwa 40 negara mayoritas muslim lainnya tidak terdampak kebijakannya ini.&nbsp;</span>\r\n</p>\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pernyataan membela diri dari Trump ini disampaikan dalam bentuk tertulis yang dirilis Gedung Putih. Langkah ini tergolong langka karena selama ini Trump lebih gemar &#39;berbicara langsung&#39; dengan publik via Twitter.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Kita akan menjaganya (AS) tetap bebas dan menjaganya tetap aman, seperti banyak media tahu. Untuk memperjelas, ini bukan larangan muslim, seperti yang diberitakan media secara salah,&quot; ucap Trump dalam pernyataannya.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Pada Jumat (27/1) lalu, Trump menandatangani perintah eksekutif yang isinya menghentikan sementara masuknya para pengungsi selama 120 hari, sedangkan untuk pengungsi Suriah batas waktu penghentian belum ditentukan batas waktunya. Perintah eksekutif Trump itu juga melarang masuknya warga dari tujuh negara yang mayoritas penduduknya muslim, yakni Iran, Irak, Libya, Somalia, Sudan, Suriah dan Yaman, selama 90 hari ke depan.</span><br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Baca juga:</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;</span><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\"><a style=\"text-decoration: none; border: none; font-weight: bold; color: #19378f\" href=\"https://news.detik.com/read/2017/01/29/152442/3408358/1148/iran-kebijakan-imigrasi-trump-hadiah-untuk-kelompok-ekstrimis\" target=\"_blank\">Iran: Kebijakan Imigrasi Trump &#39;Hadiah&#39; untuk Kelompok Ekstrimis</a></span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Dalam keputusannya, Trump mengutip tragedi 11 September 2001 sebagai pembenaran atas kebijakannya. Namun nyatanya, Trump tidak menargetkan negara asal para pelaku serangan 9/11, yakni Mesir, Libanon, Arab Saudi dan Uni Emirat Arab.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Sejak perintah eksekutif Trump diberlakukan pekan lalu, para hakim federal dari empat negara bagian AS dengan bandara internasional -- Massachusetts, New York, Virginia dan Washington -- merilis &#39;izin tinggal sementara&#39; untuk menangguhkan sebagian isi perintah eksekutif itu. Izin tinggal sementara ini mencegah otoritas masing-masing negara bagian untuk mendeportasi orang-orang yang ditahan di bandara karena larangan imigrasi Trump ini.&nbsp;</span><br />\r\n<br />\r\n<p>\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Kami akan kembali merilis visa untuk seluruh negara begitu kami yakin telah mengkaji dan memberlakukan kebijakan paling aman selama 90 hari ke depan,&quot; imbuh Trump.</span>&nbsp;\r\n</p>\r\n','','Senin','2017-01-30','09:55:22','38cee303d3-5470-4f7b-88bb-93abe4a3cc02_169.jpg',52,'internasional'),(997,39,'admin','Demonstran Berkumpul di Bandara-bandara AS Tolak Kebijakan Imigrasi Trump','Demonstran Berkumpul di Bandara-bandara AS Tolak Kebijakan Imigrasi Trump','','demonstran-berkumpul-di-bandarabandara-as-tolak-kebijakan-imigrasi-trump','N','N','N','<h1 style=\"margin: 0px; padding: 0px; font-size: 30px; color: #21409b; line-height: 36px; letter-spacing: -0.5px; font-family: helvetica, arial\">Demonstran Berkumpul di Bandara-bandara AS Tolak Kebijakan Imigrasi Trump</h1>\r\n','','Senin','2017-01-30','09:58:54','79793e25fb-a48d-4cf0-bc3b-f2a2e95393a1_169.jpg',52,'hiburan,hukum,internasional'),(998,39,'admin','Negara-Negara Ini Mengecam Pemberlakuan Imigrasi Baru AS','Negara-Negara Ini Mengecam Pemberlakuan Imigrasi Baru AS','','negaranegara-ini-mengecam-pemberlakuan-imigrasi-baru-as','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Jakarta</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\"> - Beberapa pemimpin dunia dan pemerintah, termasuk Indonesia juga menyampaikan rasa kecewanya terhadap pembatasan imigrasi yang diberlakukan oleh Presiden AS Donald Trump.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Dilansir kantor berita AFP, Senin (30/1/2017), sejumlah negara mengecam pemberlakuan pembatasan imigrasi yang diberlakukan AS.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Indonesia sangat menyesalkan langkah tersebut. Karena kita percaya itu akan mempengaruhi situasi global untuk melawan terorisme. Ini adalah hal yang salah bila menghubungkan radikalisme dan teroris dengan satu agama tertentu,\" kata Juru bicara Kementerian Luar Negeri Armanantha Nasir kepada AFP.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Berikut adalah beberapa reaksi atas pembatasan imigrasi oleh AS:</span><br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">INGGRIS</strong><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Perdana Menteri Inggris Theresa Mei mengaku tidak setuju dengan pembatasan tersebut dan akan bereaksi jika hal itu nantinya berlaku bagi warga Inggris.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Kami tidak setuju dengan pendekatan semacam ini dan itu bukan salah satu yang kita akan mengambil,\" katanya di London.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Sementara Menteri Luar Negeri Boris Johnson mengunggah pesan singkat melalui jejaring media sosial Twitter.</span><br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Akan melindungi hak-hak dan kebebasan warga negara UK dan luar negeri. Memecah belah dan salah untuk menstigmatisasi karena kebangsaan.\" seperti ikutip dari akun twitternya.</span><br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">UNI EROPA</strong><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Kebijakan Luar Negeri Uni Eropa Supremo Federica Mogherini berjanji blok itu akan terus mendukung dan mengurus mereka yang melarikan diri dari perang.\"</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Kami akan terus merayakan untuk setiap dinding yang dirobohkan dan untuk setiap jembatan baru yang dibangun. Kami akan terus bekerja untuk perdamaian dan hidup berdampingan. Ini adalah sejarah kita, ini adalah identitas kita, pekerjaan kita dan komitmen kami,\" tambah Mogherini.</span><br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">IRAN</strong><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Menteri Luar Negeri Mohammad Javad Zarif mengecam langkah Trump sebagai bentuk penghinaan untuk dunia Islam. \"Akan tercatat dalam sejarah sebagai hadiah besar untuk ekstremis dan pendukung mereka.\" ucapnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Selain itu Zarif mengatakan keputusan Trump hanya berfungsi untuk menyediakan lahan subur bagi perekrutan lebih teroris dengan memperdalam pecah dan kesalahan-garis yang telah dimanfaatkan oleh demagog ekstrimis.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Dirinya menyebut akan memberlakukan hal serupa dengan larangan Amerika Serikat untuk memasuki negaranya, meskipun tidak akan berlaku untuk mereka yang sudah memiliki visa.</span><br />\r\n<table border=\"0\" class=\"pic_artikel_sisip_table\" align=\"center\" style=\"text-align: center; margin-bottom: 10px; color: #929292; font-size: 12px; line-height: 14.4px; width: 540px; table-layout: fixed; font-family: helvetica, arial\">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<div class=\"pic_artikel_sisip\" align=\"center\" style=\"margin-bottom: 25px; font-size: 12px; line-height: 14.4px; width: 534px\">\r\n\t\t\t<div class=\"pic\" style=\"position: relative; display: inline-block; width: 540px; max-width: 100%; background: #f9f9f9; padding-bottom: 10px\">\r\n\t\t\t<img style=\"max-width: 100%; overflow: hidden; margin-bottom: 5px; display: block; margin-left: auto; margin-right: auto; height: auto !important\" src=\"https://images.detik.com/community/media/visual/2017/01/29/aa4d08cc-f74f-4946-965d-9dc88595d869.jpg?a=1\" alt=\"Negara-Negara Ini Mengecam Pemberlakuan Imigrasi Baru AS\" />Foto: REUTERS/Laura Buckman\r\n\t\t\t</div>\r\n\t\t\t</div>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">JERMAN</strong><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Juru bicara Angela Merkel mengatakan kanselir Jerman menyesalkan larangan masuk oleh AS. \"Yakin bahwa bahkan dalam pertempuran tentu tegas terhadap terorisme, itu tidak dibenarkan untuk menempatkan orang-orang dari asal tertentu atau keyakinan dicurigai umum.\" ucapnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Berlin sekarang akan memeriksa konsekuensi dari larangan tersebut bagi warga Jerman yang memiliki kewarganegaraan ganda,\" tambah juru bicara itu.</span><br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">PRANCIS</strong><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Menteri Luar Negeri Prancis Jean-Marc Ayrault mengatakan menyambut pengungsi yang melarikan diri dari perang adalah tugas negara. \"Kami harus memastikan bahwa hal ini terjadi dengan cara yang hanya adil dan dengan solidaritas. Karena keputusan ini hanya dapat menyebabkan kita prihatin.\" sebutnya.</span><br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">SWEDIA</strong><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Menteri Luar Negeri Swedia menyayangkan keputusan yang telah diberlakukan oleh Presiden Donald Trump.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Keputusan ini meningkatkan ketidakpercayaan dan ketegangan antara orang. Tidak sejak Perang Dunia II di mana memiliki begitu banyak orang melarikan diri dari perang dan konflik,\" tulisnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Ini adalah tanggung jawab bersama dari semua negara untuk membantu mereka, termasuk Amerika Serikat,\" kata Wakil Perdana Menteri Margot Wallstrom </span><br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">SWISS</strong><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Menteri Luar Negeri Swiss Didier Burkhalter mengatakan keputusan yang dibuat oleh Presiden AS Donald Trump adalah salah. Bahkan dirinya menyebut AS berjalan ke arah yang salah.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">\"Kami selalu menentang diskriminasi terhadap manusia atas dasar agama atau kebangsaan. Dalam hal ini, urutan AS jelas berjalan ke arah yang salah,\" kata Burkhalter.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Burkhalter menambahkan pemerintah Swiss akan berunding dengan perwakilan Amerika untuk mengetahui bagaimana urutan akan mempengaruhi warga Swiss, terutama warga negara ganda dari negara-negara yang terkena dampak.</span><br />\r\n<br />\r\n<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">BELANDA</strong><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Perdana Menteri Belanda Mark Rutte mengatakan semua pengungsi yang melarikan diri perang dan kekerasan layak mendapatkan tempat yang aman, tanpa memandang etnis atau agama mereka.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Dia menambahkan bahwa sementara pemerintahnya sadar potensi untuk penyalahgunaan sistem pengungsi. \"Kami menyesalkan keputusan AS untuk melarang perjalanan orang dari tujuh negara-negara Muslim dan kami menolaknya,\" katanya. </span>\r\n','','Senin','2017-01-30','10:03:53','870053fc06-ec03-48b8-bbf0-a442193f9808.jpg',40,''),(999,39,'admin','28 Warga China Hilang di Perairan Malaysia','28 Warga China Hilang di Perairan Malaysia','','28-warga-china-hilang-di-perairan-malaysia','N','N','N','<strong style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Kota Kinabalu</strong><span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&nbsp;- Sebuah kapal yang membawa 31 orang, termasuk 28 orang turis China hilang di perairan Malaysia yang berdekatan dengan pulau Kalimantan. Tim penyelamat Malaysia masih melakukan pencarian atas hilangnya kapal beserta penumpangnya itu.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Pemilik kapal melaporkan hilangnya kapal miliknya pada Sabtu sore dan kami sedang melakukan pencarian,&quot; ujar juru bicara dari lembaga maritim Malaysia seperti diberitakan AFP, Minggu (29/1/2017).</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Selain ke 28 turis China, ada 3 orang lainnya yang merupakan awak kapal juga dinyatakan hilang. Juru bicara itu menambahkan kondisi cuaca sedang buruk saat kapal itu berlayar.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Kapal itu sedang dalam perjalanan menuju sebuah pulau yang berjarak 60 kilometer dari Kota Kinabalu. &quot;Saya dan bersama yang memiliki keluarga di atas kapal itu berharap adanya perkembangan dalam oprasi pencarian dan penyelamatan,&quot; ujar Menteri Pariwisata Malasyia Masidi Manun.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">&quot;Petugas kami sedang berusaha yang terbaik,&quot; sambungnya.</span><br />\r\n<br />\r\n<span style=\"color: #2d2d2d; font-family: helvetica, arial; font-size: 16px\">Sementara itu, Kementerian Luar Negeri China mengatakan konsulat jenderal di Kota Kinabalu telah melakukan kontak dengan pihak pemerintah Malaysia dan meminta untuk melakukan upaya penyelamatan kepada pada turis yang yang hilang.</span>\r\n','','Senin','2017-01-30','10:29:03','79ba3f8214-5d91-4d3e-b8f7-f15817354d57_169.jpg',21,'internasional');
