','','23BUKA PUASA BERSAMA.jpg'),(309,53,'admin','Fellowship ISRA','fellowship-isra','','3fellowship ISRA.jpg'),(310,41,'admin','Bersatu hati mendoakan Indonesia','bersatu-hati-mendoakan-indonesia','','241936271_628326787333780_8390659835636246920_n.jpg'),(311,56,'admin','Memberikan sumbangan baju layak pakai','memberikan-sumbangan-baju-layak-pakai','','8413654358_1250289808345341_3674318539335294464_n.jpg'),(312,56,'admin','Memberikan sumbangan baju layak pakai','memberikan-sumbangan-baju-layak-pakai','','5413697131_1250289455012043_3482645223790866857_n.jpg'),(313,56,'admin','Memberikan sumbangan baju layak pakai','memberikan-sumbangan-baju-layak-pakai','','9613718799_1250289715012017_2619686292365979284_n.jpg'),(315,56,'admin','Memberikan sumbangan baju layak pakai','memberikan-sumbangan-baju-layak-pakai','','7113726797_1250289635012025_1740157915393678038_n.jpg'),(316,57,'admin','Penyanyi Lita Zein membawakan beberapa lagu rohani ','penyanyi-lita-zein-membawakan-beberapa-lagu-rohani-','','80kr.jpg'),(317,57,'admin','Sita Simorangkir','sita-simorangkir','','11kr1.jpg'),(318,57,'admin','Nindy Ellesse','nindy-ellesse','','33kr2.jpg'),(319,57,'admin','Pendeta Jonathan Pattiasina','pendeta-jonathan-pattiasina','','60kr3.jpg'),(320,57,'admin','Doa Bersama','doa-bersama','','1kr4.jpg'),(321,33,'admin','AIR HIDUP','air-hidup','<blockquote>\r\n\t<p>\r\n\t&ldquo;Dan pada hari terakhir, yaitu pada puncak perayaan itu, \r\n\tYesus berdiri dan berseru: &ldquo;Barangsiapa haus, bai klah ia datang \r\n\tkepada-Ku dan minum&rdquo;\r\n\t</p>\r\n\t<p>\r\n\t(Yohanes 7:37)\r\n\t</p>\r\n</blockquote>\r\n<p>\r\nYohanes 4:1-25\r\n</p>\r\n<p>\r\nManusia hidup pasti membutuhkan air, bukan? Orang bisa berpuasa \r\nberminggu-minggu tanpa makan, namun manusia tidak dapat hidup tanpa air,\r\nitu sebabnya air merupakan sumber kehidupan bagi manusia. Meskipun \r\ndalam padang belantara, TUHAN sanggup menyediakan oase bagi mereka yang \r\nhaus dan penat. Penduduk pulau Palue, bagian NTT, merupkan daerah yang \r\nsangat kering, bahkan sumber air pun tidak terdapat disana. Mereka \r\nsepenuhnya bergantung kepada iar hujan. Sedangkan kemarau disana cukup \r\npanjang. Apa yang dapat mereka lakukan, karena mereka perlu hidup? \r\nSetiap keluarga menanam di rumahnya paling sedikit tiga pohon pisang dan\r\nmelubanginya. Pohon pisang merupakan sumber air bagi mereka.\r\n</p>\r\n<p>\r\nTuhan Yesus berkata bahwa Dia adalah Air hidup. Barangsiapa minum \r\ndari &ldquo;Air&rdquo; itu dia tidak akan haus lagi untuk selamanya. Artinya, jika \r\nseseorang percaya kepada Yesus, maka hidupnya akan diubahkan sepenuhnya.\r\nHidup yang dahulunya penuh kekecewaan, kebencian dan tidak ada \r\npengharapan tetapi saatnya akan menjadi kehidupan yang penuh harapan dan\r\nsukacita. Seperti perempuan Samaria yang telah dipenuhi Air hidup \r\nmenerima Yesus dalam hidupnya. Jiwanya dipuaskan. Perempuan itu tidak \r\ngelisah lagi, dia berubah menjadi perempuan yang berani menghadapi \r\nmasyarakat. Bahkan menjadi saksi Kristus.\r\n</p>\r\n<p>\r\nMaukah Anda menerima sukacita dan damai sejahtera-Nya? Hanya ada satu\r\njalan, yakni percaya dan menerima Yesus sebagai Tuhan dan Juruselamat.\r\n</p>\r\n','48dsqwdqw.jpeg');
