INSERT INTO `halamanstatis` VALUES (18,'Tentang Kami','tentang-kami','<p>\r\nIngin mempunyai website seperti isranewsindonesia.com ini? Bingung membuat website?\r\nKami menawarkan jasa pembuatan website berkualitas dengan fitur professional.\r\nKami melayani pembuatan website untuk keperluan website pribadi (personal\r\nwebsite), perusahaan (company profile), website sekolah (web school), photography\r\n(web gallery), toko online (e-commerce) serta website untuk keperluan khusus\r\nbagi perusahan, organisasi, lembaga pemerintah, personal, komunitas,\r\norganisasi, UKM atau lainnya.<br />\r\n<br />\r\n<strong>Kelebihan Kami</strong><br />\r\nKelebihan kami adalah kemampuan untuk menawarkan kepada anda layanan penuh.\r\nMulai dari desain web, script, keamanan sistem, garansi kerusakan, sesuai\r\nstandar dan tren web terkini. Selain itu kami juga telah menggunakan CMS\r\n(Content Management System) sehingga memudahkan anda untuk mengelola website\r\nsemudah mengelola file dokumen Microsoft Word. Cukup dengan keahlian mengetik\r\ndi Microsoft Word anda sudah dapat menjadi webmaster yang powerfull dan\r\nprofesional. \r\n</p>\r\n<p>\r\nBerbekal pengalaman dalam jasa pembuatan website ke berbagai perusahaan dan\r\nlainnya, kami siap membantu untuk menghadirkan website anda di internet melalui\r\nbeberapa produk desain website kami. Segera hubungi kami dan dapatkan website\r\nidaman anda! <br />\r\n<br />\r\n<strong>Berikut beberapa demo/contoh website produk kami:&nbsp;</strong>\r\n</p>\r\n<ul>\r\n\t<li><a href=\"http://griya-parfum.co.cc\">GriyaParfum</a> </li>\r\n\t<li><a href=\"http://luxindotours.com\">Luxindo Tours</a> </li>\r\n\t<li><a href=\"http://iwapi-pusat.org\">Iwapi Pusat</a> </li>\r\n\t<li><a href=\"http://kuejajananpasar.com\">Kue Jajanan Pasar</a> </li>\r\n\t<li><a href=\"http://kenrizresto.co.cc\">KenrizResto</a> </li>\r\n\t<li><a href=\"http://resoar.co.cc\">Reka Solusi Arthamedia</a> </li>\r\n\t<li><a href=\"http://eksotika-photography.co.c\">Eksotika Photography</a> </li>\r\n\t<li><a href=\"http://griyagaya.co.cc\">Griyagaya</a> </li>\r\n\t<li><a href=\"http://rizalonline.morganhosting.co.cc/anekajam\">Aneka Jam</a> </li>\r\n\t<li><a href=\"http://rizalonline.morganhosting.co.cc/artfurniture\">Art Furniture</a> </li>\r\n\t<li><a href=\"http://rizalonline.morganhosting.co.cc/selarasinterior\">Selaras Interior</a> </li>\r\n</ul>\r\n<p>\r\n<font size=\"3\">Hubungi kami <strong>Pt m2d atau kunjungi websitenya m2d.asia</strong></font>\r\n</p>\r\n<p>\r\n<font size=\"3\">atau <strong>Email: saifuddinahmad12@gmail.com</strong></font>\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n','2016-03-08','webdesign.jpg','admin',1069,'20:08:00','Kamis'),(32,'majalah isra jakarta maret sampai juni','majalah-isra-jakarta-maret-sampai-juni','<iframe width=\"600px\" height=\"600px\" src=\"http://online.fliphtml5.com/dvnk/noxe/#p=1\" frameborder=\"0\" allowfullscreen allowtransparency></iframe>\r\n','2016-06-21','','admin',236,'13:30:47','Selasa');
